INSERT INTO `nota` VALUES ('80', null, '2016', '7978', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a MARIBEL ORDUÑO CLAVEL promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DE LA REGISTRADA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO 7/A PONIENTE 404 PINOTEPA NACIONAL, OAXACA Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO MAGALENA C. CLAVEL NICIO Y DE ACUERDO A EL ACTA DE  NACIMIENTO DE LA MISMA, CON NUMERO DE ACTA 21 DE FECHA 11/04/1950 LEVANTADA EN SANTIAGO PINOTEPA NACIONAL, LO CORRECTO DEBE SER: MAGDALENA CLEOTILDE CLAVEL NICIO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: MARIBEL ORDUÑO CLAVEL levantada según registro número 115 de fecha 01 de MARZO de 1982 en SANTIAGO PINOTEPA NACIONAL,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA.- EL NOMBRE DE LA MADRE DE LA REGISTRADA : MAGDALENA CLEOTILDE CLAVEL NICIO.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por MARIBEL ORDUÑO CLAVEL por su propio derecho .-Expediente Número 7978/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/CCC');
INSERT INTO `nota` VALUES ('81', null, '2016', '7979', '\0', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 13 de ENERO de 1959</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a MACARIO ACEVEDO CRUZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. OMISION PARCIAL DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. ERROR ORTOGRAFICO DE EL NOMBRE DEL PADRE DE LA REGISTRADA. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL ABUELO PATERNO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO ACEBEDO Y DE ACUERDO A LAS REGLAS ORTOGRAFICAS DE ESCRITURA, LO CORRECTO DEBE SER: ACEVEDO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 2 DEL ACTUAL Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 02/01/1959 DOS DE ENERO DE MIL NOVECIENTOS CINCUENTA Y NUEVE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO ESTA AGENCIA Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: COLLANTES, SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR ORTOGRAFICO DE EL NOMBRE DEL PADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO ACEBEDO Y ALATERADO EL APELLIDO MATERNO Y DE ACUERDO A LAS REGLAS ORTOGRAFICAS QUE RIGEN EL IDIOMA ESPAÑOL Y AL APELLIDO DE LA ABUELA PATERNA, LO CORRECTO DEBE SER: LUCIANO ACEVEDO MARICHER </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL ABUELO PATERNO, TENEMOS QUE APARECE ASENTADO(A) COMO ACEBEDO Y DE ACUERDO A LAS REGLAS ORTOGRAFICAS QUE RIGEN EL IDIOMA ESPAÑOL, LO CORRECTO DEBE SER: ACEVEDO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: MACARIO ACEVEDO CRUZ levantada según registro número 6 de fecha 13 de ENERO de 1959 en COLLANTES,SANTIAGO PINOTEPA NACIONAL,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES I, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 32 y 37 Fracc. I, II y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL APELLIDO PATERNO DE LA REGISTRADA : ACEVEDO.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 02/01/1959 DOS DE ENERO DE MIL NOVECIENTOS CINCUENTA Y NUEVE.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : COLLANTES, SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA.- EL NOMBRE DEL PADRE DE LA REGISTRADA : LUCIANO ACEVEDO MARICHER.- EL APELLIDO PATERNO DEL ABUELO PATERNO : ACEVEDO.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por MACARIO ACEVEDO CRUZ por su propio derecho .-Expediente Número 7979/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/');
INSERT INTO `nota` VALUES ('82', null, '2016', '7980', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ROVERIANA AVENDAÑO promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. OMISION PARCIAL DE EL APELLIDO PATERNO DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL PUEBLO DE SANTA DOMINGO TEOJOMULCO, EX DISTRITO DE SOLA DE VEGA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION PARCIAL DE EL APELLIDO PATERNO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO AVENDAÑO EN LA PARTE SUPERIOR Y OMISION EN EL TEXTO DEL ACTA Y DE ACUERDO A QUE SE DEDUCE DEL APELLIDO DEL PROGENITOR QUIEN COMPARECIO AL MOMENTO DEL REGISTRO, LO CORRECTO DEBE SER: AVENDAÑO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EL DIA DE AYER Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 01/06/1939 UNO DE JUNIO DE MIL NOVECIENTOS TREINTA Y NUEVE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU DOMICILIO CASA SIN NUMERO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ROVERIANA AVENDAÑO levantada según registro número 42 de fecha 02 de JUNIO de 1930 en SANTO DOMINGO TEOJOMULCO,SOLA DE VEGA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  II del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA.- EL APELLIDO PATERNO DE LA REGISTRADA : AVENDAÑO.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 01/06/1939 UNO DE JUNIO DE MIL NOVECIENTOS TREINTA Y NUEVE.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ROVERIANA AVENDAÑO por su propio derecho .-Expediente Número 7980/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGP');
INSERT INTO `nota` VALUES ('84', null, '2016', '7982', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a MOISES SANCHEZ GARCIA promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE LA NACIONALIDAD DE LOS PROGENITORES. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA AGENCIA MUNICIPAL DE LA PAZ,MUNICIPIO DE MONTEVERDE DISTRITO DE PUTLA, ESTADO DE OAXACA Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: LA PAZ, SANTA LUCIA MONTEVERDE, PUTLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO SANCHEZ GARCIA MOSES EN LA PARTE SUPERIOR Y MOICES(ENMENDADO) EN EL TEXTO Y DE ACUERDO A LA RELACION DE FILIACIÓN QUE EXISTE ENTRE LOS PROGENITORES Y EL REGISTRADO Y QUE DE LA PARTE SUPERIOR SE DESPRENDE EL NOMBRE CORRECTO, LO CORRECTO DEBE SER: MOISES GARCIA SANCHEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO 5 DE LOS CORRIENTES Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 05/10/1955 CINCO DE OCTUBRE DE MIL NOVECIENTOS CINCUENTA Y CINCO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 39  Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: LA PAZ, SANTA LUCIA MONTEVERDE, PUTLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-OMISION DE LA NACIONALIDAD DE LOS PROGENITORES Y DE ACUERDO A LA CONSTANCIA DE ORIGEN Y VECINDAD QUE SE ANEXA, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: MOISES SANCHEZ GARCIA levantada según registro número 17 de fecha 06 de OCTUBRE de 1955 en LA PAZ,SANTA LUCIA MONTEVERDE,PUTLA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : LA PAZ, SANTA LUCIA MONTEVERDE, PUTLA, OAXACA.- EL NOMBRE DEL REGISTRADO : MOISES GARCIA SANCHEZ.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 05/10/1955 CINCO DE OCTUBRE DE MIL NOVECIENTOS CINCUENTA Y CINCO.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : LA PAZ, SANTA LUCIA MONTEVERDE, PUTLA, OAXACA.- LA NACIONALIDAD DE LOS PROGENITORES : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por MOISES SANCHEZ GARCIA por su propio derecho .-Expediente Número 7982/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SANTA LUCIA MONTEVERDE, PUTLA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGM');
