INSERT INTO `nota` VALUES ('87', null, '2016', '7985', 'O', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a VALENTINO LOPEZ GABRIEL  promoviendo a favor de VALENTINO  LOPEZ  GABRIEL</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO DEL RECONOCIDO. OMISION DE EL NOMBRE DE LA MADRE DEL RECONOCEDOR.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE RECONOCIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO DEL RECONOCIDO, TENEMOS QUE APARECE ASENTADO(A) COMO OCOTLAN DE MORELOS, OCOTLAN DE MORELOS, OCOTLAN DE MORELOS, OAXACA. Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD , LO CORRECTO DEBE SER: OCOTLAN DE MORELOS, OCOTLAN, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-OMISION DE EL NOMBRE DE LA MADRE DEL RECONOCEDOR Y DE ACUERDO A EL ACTA DE NACIMIENTO DE LA MISMA DE FECHA 3 DE NOVIEMBRE DE 1939, LEVANTADA EN SANTO DOMINGO JALIEZA, OCOTLAN, OAXACA. , LO CORRECTO DEBE SER:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de RECONOCIMIENTO de: VALENTINO  LOPEZ  GABRIEL  levantada seg&uacute;n registro n&uacute;mero 108 de fecha 28 de AGOSTO de 1985 en OCOTLAN DE MORELOS,OCOTLAN,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO DEL RECONOCIDO : OCOTLAN DE MORELOS, OCOTLAN, OAXACA.- EL NOMBRE DE LA MADRE DEL RECONOCEDOR DE ACUERDO A EL ACTA DE NACIMIENTO : CIRENIA FELIPA GABRIEL .-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por VALENTINO LOPEZ GABRIEL  a favor del registrado .-Expediente N&uacute;mero 7985/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. Oficial del Registro Civil de OCOTLAN DE MORELOS, OCOTLAN, OAXACA, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/VSM</p>');
INSERT INTO `nota` VALUES ('90', null, '2016', '7987', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ADELA MORENO MENDOZA promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DE LA REGISTRADA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 11 DE OCTUBRE DE 1986 Y DE ACUERDO A QUE LO CORRECTO ES CON NUMERO Y LETRA, LO CORRECTO DEBE SER: 11/10/1986 ONCE DE OCTUBRE DE MIL NOVECIENTOS OCHENTA Y SEIS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO SALINA CRUZ OAXACA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SALINA CRUZ, TEHUANTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO MERCEDES MENDOZA HERNANDEZ Y DE ACUERDO A AL ACTA DE NACIMIENTO DE LA MADRE CON NUMERO DE ACTA 29 DE FECHA 10 DE AGOSTO DE 1952 LEVANTADA EN SANTA MARIA GUIEGOLANI YAUTEPEC., LO CORRECTO DEBE SER: MERCED MENDOZA HERNANDEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ADELA MORENO MENDOZA levantada según registro número 2161 de fecha 25 de NOVIEMBRE de 1986 en SALINA CRUZ,TEHUANTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: LA FECHA DE NACIMIENTO DE LA REGISTRADA : 11/10/1986 ONCE DE OCTUBRE DE MIL NOVECIENTOS OCHENTA Y SEIS.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SALINA CRUZ, TEHUANTEPEC, OAXACA.- EL NOMBRE DE LA MADRE DE LA REGISTRADA : MERCED MENDOZA HERNANDEZ.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ADELA MORENO MENDOZA por su propio derecho .-Expediente Número 7987/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de PRIMERA OFICIALIA SALINA CRUZ, TEHUANTEPEC, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('94', null, '2016', '7993', 'A', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a VILMA GARRIDO MARTIN promoviendo a favor de ANTONIO VASCONCELOS MARTINEZ</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL NOMBRE DEL CONTRAYENTE. ERROR DE ESCRITURA DE LA EDAD DE LA CONTRAYENTE. ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DE LA CONTRAYENTE.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE MATRIMONIO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-ERROR DE ESCRITURA DE EL NOMBRE DEL CONTRAYENTE, TENEMOS QUE APARECE ASENTADO(A) COMO ANTONIO VASCONCELOS MARTINEZ REMARCADO EL PRIMER APELLIDO Y DE ACUERDO A LAS REGLAS DE ESCRITURA Y DE ORTOGRAF&Iacute;A QUE NOS RIGEN, LO CORRECTO DEBE SER: ANTONIO VASCONSELOS MARTINEZ</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-ERROR DE ESCRITURA DE LA EDAD DE LA CONTRAYENTE, TENEMOS QUE APARECE ASENTADO(A) COMO 29 A&Ntilde;OS Y DE ACUERDO A AL ACTA DE NACIMIENTO DE LA CONTRAYENTE CON NUMERO DE ACTA  471 DE FECHA 01 DE JUNIO DE 1987 LEVANTADA EN SAN JUAN GUICHICOVI, LO CORRECTO DEBE SER: 20 VEINTE A&Ntilde;OS</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DE LA CONTRAYENTE, TENEMOS QUE APARECE ASENTADO(A) COMO FELICIANO GARRIDO MARIA  REMARCADO EN NOMBRE PROPIO Y DE ACUERDO A LAS REGLAS DE ESCRITURA Y DE ORTOGRAF&Iacute;A QUE NOS RIGEN, LO CORRECTO DEBE SER: FELICIANO GARRIDO MARIA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de MATRIMONIO de: ANTONIO VASCONCELOS MARTINEZ levantada seg&uacute;n registro n&uacute;mero 67 de fecha 02 de MAYO de 2006 en SAN JUAN GUICHICOVI,JUCHITAN,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos, 100 Fraccion I, 141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y  del Reglamento del Registro Civil se aclaran los siguientes datos: EL NOMBRE DEL CONTRAYENTE : ANTONIO VASCONSELOS MARTINEZ.- LA EDAD DE LA CONTRAYENTE : 20 VEINTE A&Ntilde;OS.- EL NOMBRE DEL PADRE DE LA CONTRAYENTE : FELICIANO GARRIDO MARIA.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por VILMA GARRIDO MARTIN a favor de los contrayentes .-Expediente N&uacute;mero 7993/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. OFICIAL DEL REGISTRO CIVIL DE SAN JUAN GUICHICOVI, JUCHITAN, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/DCA</p>');
INSERT INTO `nota` VALUES ('97', null, '2016', '7991', 'A', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a MARIA ASUNCION LOPEZ DELGADO promoviendo a favor de MARIA DE JESUS LOPEZ REYES</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION PARCIAL DE EL LUGAR DE REGISTRO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. OMISION DE EL ESTADO BIOLOGICO. OMISION DE LA NACIONALIDAD DE LOS PROGENITORES.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-OMISION PARCIAL DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CIUDAD Y PUERTO DE SALINA CRUZ, EX DISTRITO DE TEHUANTEPEC Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SALINA CRUZ, TEHUANTEPEC, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO DEL DIA 17 DIECISIETE DEL MES DE JULIO ACTUAL Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 17/07/1971 DIECISIETE DE JULIO DE MIL NOVECIENTOS SETENTA Y UNO</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO HOSPITAL DE MINATITLAN VER Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL HOSPITAL QUE SE MENCIONA, LO CORRECTO DEBE SER: MINATITLAN, VERACRUZ, MEXICO</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A LOS DOCUMENTOS PUBLICOS Y PRIVADOS PRESENTADOS, LO CORRECTO DEBE SER: VIVA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">5.-OMISION DE LA NACIONALIDAD DE LOS PROGENITORES Y DE ACUERDO A QUE SE DEDUCE DEL TEXTO DEL ACTA, LO CORRECTO DEBE SER: MEXICANA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: MARIA DE JESUS LOPEZ REYES levantada seg&uacute;n registro n&uacute;mero 76 de fecha 29 de JULIO de 1971 en SALINA CRUZ,TEHUANTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SALINA CRUZ, TEHUANTEPEC, OAXACA.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 17/07/1971 DIECISIETE DE JULIO DE MIL NOVECIENTOS SETENTA Y UNO.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : MINATITLAN, VERACRUZ, MEXICO.- EL ESTADO BIOLOGICO : VIVA.- LA NACIONALIDAD DE LOS PROGENITORES : MEXICANA.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por MARIA ASUNCION LOPEZ DELGADO a favor del registrado .-Expediente N&uacute;mero 7991/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. OFICIAL DEL REGISTRO CIVIL DE PRIMERA OFICIALIA SALINA CRUZ, TEHUANTEPEC, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/EAS</p>');
INSERT INTO `nota` VALUES ('100', null, '2016', '7988', 'C', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 07 de ABRIL de 1953</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ESTEBAN GONZALEZ CABRERA promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION DE EL LUGAR DE REGISTRO. OMISION DE EL NOMBRE DEL REGISTRADO. OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO. OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO. OMISION DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE EL APELLIDO PATERNO DEL PADRE DEL REGISTRADO. OMISION DE LA NACIONALIDAD DEL PADRE. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION DE EL LUGAR DE REGISTRO Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: SAN PEDRO TAPANATEPEC, JUCHITAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE EL NOMBRE DEL REGISTRADO Y DE ACUERDO A QUE EL PRIMER APELLIDO LE CORESPONDE LEGALMENTE POR HABER SIDO EL PROGENITOR QUIEN COMPARECIO AL REGISTRO DE NACIMIENTO Y EL SEGUNDO SE APLICA DE ACUERDO AL ARTÍCULO 141 FRACCIÓN VI SEGUNDA PARTE DE CÓDIGO CIVIL DEL ESTADO, EL CUAL SEÑALA QUE PROCEDE LA ACLARACIÓN DEL ACTA PARA EL SOLO EFECTO DE AGREGAR EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION, ASI COMO REGLAS DE ORTOGRAFIA QUE NOS RIGEN,  POR LO QUE EL NOMBRE COMPLETO Y CORRECTO DEBE SER: , LO CORRECTO DEBE SER: ESTEBAN GONZALEZ CABRERA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y LA DE NACIMIENTO, LO CORRECTO DEBE SER: 28/03/1953 VEINTIOCHO DE MARZO DE MIL NOVECIENTOS CINCUENTA Y TRES </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y LA DE NACIMIENTO, LO CORRECTO DEBE SER: 28/03/1953 VEINTIOCHO DE MARZO DE MIL NOVECIENTOS CINCUENTA Y TRES </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-OMISION DE EL LUGAR DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A QUE EL NACIMIENTO OCURRIO EN EL MISMO LUGAR DE REGISTRO, LO CORRECTO DEBE SER: SAN PEDRO TAPANATEPEC, JUCHITAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-OMISION DE EL APELLIDO PATERNO DEL PADRE DEL REGISTRADO Y DE ACUERDO A LAS REGLAS DE ORTOGRAFÍA QUE RIGEN AL IDIOMA ESPAÑOL, LO CORRECTO DEBE SER: GONZALEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>7.-OMISION DE LA NACIONALIDAD DEL PADRE Y DE ACUERDO A LA CONSTANCIA DE ORIGEN Y VECINDAD, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ESTEBAN GONZALEZ CABRERA levantada según registro número 49 de fecha 07 de ABRIL de 1953 en SAN PEDRO TAPANATEPEC,JUCHITAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31 y 37 Fracc. I, III y IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN PEDRO TAPANATEPEC, JUCHITAN, OAXACA.- EL NOMBRE DEL REGISTRADO : ESTEBAN GONZALEZ CABRERA.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 28/03/1953 VEINTIOCHO DE MARZO DE MIL NOVECIENTOS CINCUENTA Y TRES.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 28/03/1953 VEINTIOCHO DE MARZO DE MIL NOVECIENTOS CINCUENTA Y TRES.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN PEDRO TAPANATEPEC, JUCHITAN, OAXACA.- EL APELLIDO PATERNO DEL PADRE DEL REGISTRADO : GONZALEZ.- LA NACIONALIDAD DEL PADRE : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ESTEBAN GONZALEZ CABRERA por su propio derecho .-Expediente Número 7988/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/');
INSERT INTO `nota` VALUES ('101', null, '2016', '7989', 'O', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a LINA VASQUEZ GARCIA  promoviendo a favor de LINA  VASQUEZ  GARCIA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. OMISION DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. OMISION PARCIAL DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. OMISION DE EL NOMBRE DE LA MADRE DE LA REGISTRADA.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO SAN MIGUEL TILQUIAPAM, OCOTLAN, OAX. SAN MIGUEL TILQUIAPAN, OCOTLAN DE MORELOS, OAXACA.  Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS DE LA ENTIDAD, LO CORRECTO DEBE SER: SAN MIGUEL TILQUIAPAM, OCOTLAN, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-OMISION DE EL NOMBRE DE LA REGISTRADA Y DE ACUERDO A LA RELACION  DE FILIACION QUE EXISTE ENTRE LOS PROGENITORES Y LA REGISTRADA, LO CORRECTO DEBE SER: LINA VASQUEZ GARCIA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 23 DE SEPTIEMBRE DE 1985 Y DE ACUERDO A QUE LO CORRECTO ES CON NUMERO Y LETRA, LO CORRECTO DEBE SER: 23/09/1985 VEINTITRES DE SEPTIEMBRE DE MIL NOVECIENTOS OCHENTACINCO</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-OMISION PARCIAL DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO SAN MIGUEL TILQUIAPAM, OCOTLAN, OAX. Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN MIGUEL TILQUIAPAM, OCOTLAN, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">5.-OMISION DE EL NOMBRE DE LA MADRE DE LA REGISTRADA Y DE ACUERDO A EL ACTA DE NACIMIENTO DE LA MISMA DE FECHA 24 DE JULIO DE 1956, LEVANTADA EN SAN MIGUEL TILQUIAPAM, OCOTLAN, OAXACA. , LO CORRECTO DEBE SER: CRISTINA  GARCIA  SORIANO</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: LINA  VASQUEZ  GARCIA  levantada seg&uacute;n registro n&uacute;mero 142 de fecha 28 de NOVIEMBRE de 1985 en SAN MIGUEL TILQUIAPAM,OCOTLAN,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN MIGUEL TILQUIAPAM, OCOTLAN, OAXACA.- EL NOMBRE DE LA REGISTRADA : LINA VASQUEZ GARCIA .- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 23/09/1985 VEINTITRES DE SEPTIEMBRE DE MIL NOVECIENTOS OCHENTACINCO.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SAN MIGUEL TILQUIAPAM, OCOTLAN, OAXACA.- EL NOMBRE DE LA MADRE DE LA REGISTRADA DE ACUERDO A SU ACTA DE NACIMIENTO : CRISTINA  GARCIA  SORIANO .-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por LINA VASQUEZ GARCIA  a favor del registrado .-Expediente N&uacute;mero 7989/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. Oficial del Registro Civil de OCOTLAN DE MORELOS, OCOTLAN, OAXACA, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/VSM</p>');
INSERT INTO `nota` VALUES ('102', null, '2016', '7990', 'C', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a GLORIA AIDA MENDEZ FABIAN promoviendo a favor de GLORIA AIDA  MENDEZ FABIAN</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION DE EL LUGAR DE REGISTRO. OMISION DE EL NOMBRE DE LA REGISTRADA. OMISION DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. OMISION DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. OMISION DE EL ESTADO BIOLOGICO. OMISION DE EL APELLIDO PATERNO DEL PADRE DE LA REGISTRADA. OMISION DE EL NOMBRE DE LA MADRE DE LA REGISTRADA. OMISION DE LA NACIONALIDAD DE LOS PROGENITORES. OMISION DE EL(LOS) NOMBRE(S) PROPIO(S) DE LA ABUELA MATERNA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION DE EL LUGAR DE REGISTRO Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN MARTIN TILCAJETE, OCOTLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE EL NOMBRE DE LA REGISTRADA Y DE ACUERDO A LAS REGLAS DE ESCRITURA EN CUANTO AL  SEGUNDO NOMBRE PROPIO DE LA MISMA, TODA VEZ QUE LA ESCRITURA ASENTADA EN EL DOCUMENTO RESULTA INCONGRUENTE CON LA PRONUNCIACIÓN; ADEMAS DE LA RELACIÓN DE FILIACIÓN QUE EXISTE ENTRE LOS PROGENITORES Y LA REGISTRADA, LO CORRECTO DEBE SER: GLORIA AIDA MENDEZ FABIAN </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION DE LA FECHA DE NACIMIENTO DE LA REGISTRADA Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 13/04/1963 TRECE DE ABRIL DE MIL NOVECIENTOS SESENTA Y TRES </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN MARTIN TILCAJETE, OCOTLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A LAS REGLAS DE ESCRITURA, LO CORRECTO DEBE SER: VIVA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-OMISION DE EL APELLIDO PATERNO DEL PADRE DE LA REGISTRADA Y DE ACUERDO A LAS REGLAS DE ESCRITURA Y APELLIDO  DEL ABUELO PATERNO ASENTADO EN EL TEXTO DEL ACTA, LO CORRECTO DEBE SER: MENDEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>7.-OMISION DE EL NOMBRE DE LA MADRE DE LA REGISTRADA Y DE ACUERDO A LOS APELLIDOS DE LOS ABUELOS MATERNOS ASENTADOS EN EL TEXTO DEL ACTA, LO CORRECTO DEBE SER: IMELDA FABIAN GUTIERREZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>8.-OMISION DE LA NACIONALIDAD DE LOS PROGENITORES Y DE ACUERDO A QUE SE DEDUCE DEL MISMO TEXTO DEL ACTA, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>9.-OMISION DE EL(LOS) NOMBRE(S) PROPIO(S) DE LA ABUELA MATERNA Y DE ACUERDO A LAS REGLAS ORTOGRÁFICAS QUE NOS RIGEN, LO CORRECTO DEBE SER: CONSUELO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: GLORIA AIDA  MENDEZ FABIAN levantada según registro número 12 de fecha 15 de ABRIL de 1963 en SAN MARTIN TILCAJETE,OCOTLAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31 y 37 Fracc. I, III y IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN MARTIN TILCAJETE, OCOTLAN, OAXACA.- EL NOMBRE DE LA REGISTRADA : GLORIA AIDA MENDEZ FABIAN.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 13/04/1963 TRECE DE ABRIL DE MIL NOVECIENTOS SESENTA Y TRES.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SAN MARTIN TILCAJETE, OCOTLAN, OAXACA.- EL ESTADO BIOLOGICO : VIVA.- EL APELLIDO PATERNO DEL PADRE DE LA REGISTRADA : MENDEZ.- EL NOMBRE DE LA MADRE DE LA REGISTRADA : IMELDA FABIAN GUTIERREZ.- LA NACIONALIDAD DE LOS PROGENITORES : MEXICANA.- EL(LOS) NOMBRE(S) PROPIO(S) DE LA ABUELA MATERNA : CONSUELO.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por GLORIA AIDA MENDEZ FABIAN a favor del registrado .-Expediente Número 7990/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGP');
INSERT INTO `nota` VALUES ('103', null, '2016', '7996', 'C', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a GREGORIO GARCIA GARCIA promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN SAN PEDRO JALTEPETONGO Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN PEDRO JALTEPETONGO, CUICATLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO GREGORIO GARCIA EN EL TEXTO DEL ACTA Y EN LA PARTE SUPERIOR GARCIA GREGORIO Y DE ACUERDO A QUE EL PRIMER APELLIDO LE CORESPONDE LEGALMENTE POR HABER SIDO EL PROGENITOR QUIEN COMPARECIO AL REGISTRO DE NACIMIENTO Y EL SEGUNDO SE APLICA DE ACUERDO AL ARTÍCULO 141 FRACCIÓN VI SEGUNDA PARTE DE CÓDIGO CIVIL DEL ESTADO, LA CUAL SEÑALA QUE PROCEDE LA ACLARACIÓN DEL ACTA PARA EL SOLO EFECTO DE AGREGAR EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION, POR LO QUE EL NOMBRE COMPLETO Y CORRECTO DEBE SER:  GREGORIO GARCIA GARCIA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO HOY Y DE ACUERDO A SE DEDUCE DE LA FECHA DE REGISTRO, TODA VEZ QUE SE REGISTRO EL MISMO DIA EN QUE NACIO Y SE DEDUCE DE LA RELACION CRONOLOGICA ENTRE LA HORA DE SU NACIMIENTO Y LA HORA EN QUE SE REGISTRO, LO CORRECTO DEBE SER: 09/05/1948 NUEVE DE MAYO DE MIL NOVECIENTOS CUARENTA Y OCHO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 8 OCHO DE LA CALLE DE MORELOS Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN PEDRO JALTEPETONGO, CUICATLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: GREGORIO GARCIA GARCIA levantada según registro número 17 de fecha 26 de MAYO de 1948 en SAN PEDRO JALTEPETONGO,CUICATLAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V, VI segunda parte,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN PEDRO JALTEPETONGO, CUICATLAN, OAXACA.- SE AGREGA EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION Y EL NOMBRE COMPLETO Y CORRECTO DEBE SER: GREGORIO GARCIA GARCIA.-LA FECHA DE NACIMIENTO DEL REGISTRADO : 09/05/1948 NUEVE DE MAYO DE MIL NOVECIENTOS CUARENTA Y OCHO.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN PEDRO JALTEPETONGO, CUICATLAN, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por GREGORIO GARCIA GARCIA por su propio derecho .-Expediente Número 7996/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGP');
