EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE EL MISMO REGISTRADO PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO FELIX CELEDONIO EN EL TEXTO Y EN LA PARTE SUPERIOR DEL ACTA LLAGUNO FELIX CELEDONIO Y DE ACUERDO A QUE EL PRIMER APELLIDO LE CORESPONDE LEGALMENTE POR HABER SIDO EL PROGENITOR QUIEN COMPARECIO AL REGISTRO DE NACIMIENTO Y EL SEGUNDO SE APLICA DE ACUERDO AL ARTÍCULO 141 FRACCIÓN VI SEGUNDA PARTE DE CÓDIGO CIVIL DEL ESTADO, LA CUAL SEÑALA QUE PROCEDE LA ACLARACIÓN DEL ACTA PARA EL SOLO EFECTO DE AGREGAR EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION, POR LO QUE EL NOMBRE COMPLETO Y CORRECTO DEBE SER:  FELIX CELEDONIO LLAGUNO DIAZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DIA 1 DE MARZO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 01/03/1956 UNO DE MARZO DE MIL NOVECIENTOS CINCUENTA Y SEIS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 17 Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN JUAN DEL ESTADO, ETLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: FELIX CELEDONIO LLAGUNO DIAZ levantada según registro número 5 de fecha 02 de MARZO de 1956 en SAN JUAN DEL ESTADO,ETLA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V, VI segunda parte,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL ESTADO BIOLOGICO : VIVO.- SE AGREGA EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION Y EL NOMBRE COMPLETO Y CORRECTO DEBE SER: FELIX CELEDONIO LLAGUNO DIAZ.-LA FECHA DE NACIMIENTO DEL REGISTRADO : 01/03/1956 UNO DE MARZO DE MIL NOVECIENTOS CINCUENTA Y SEIS.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN JUAN DEL ESTADO, ETLA, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por FELIX CELEDONIO  LLAGUNO DIAZ a favor del registrado .-Expediente Número 7997/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de VILLA DE ETLA, ETLA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('106', null, '2016', '7994', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a JORAM DIEGO RIOS PEREZ promoviendo a favor de REYNA GUADALUPE PEREZ RIOS</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. OMISION DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. OMISION DE EL NOMBRE DEL PADRE DE LA REGISTRADA. OMISION DE LA NACIONALIDAD DEL PADRE. OMISION DE DATOS RELATIVOS A LA MADRE.-  </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL MUNICIPIO DE SANTA MARIA COIXTEPEC, DEL MUNICIPIO DE SANTIAGO XANICA DEL DISTRITO MIXE  Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SANTA MARIA COIXTEPEC, SANTIAGO XANICA, MIAHUATLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE EL NOMBRE DE LA REGISTRADA Y DE ACUERDO A QUE EL PRIMER APELLIDO LE CORESPONDE LEGALMENTE POR HABER SIDO EL PROGENITOR QUE COMPARECIO AL REGISTRO Y A LA FOTOCOPIA DE MATRIMONIO QUE ENSEGUIDA SE DETALLARA, LO CORRECTO DEBE SER: REYNA GUADALUPE PEREZ RIOS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 12 DEL ACTUAL Y DE ACUERDO A QUE EXISTE RELACION LOGICA ENTRE LA FECHA DE REGISTRO Y LA DE NACIMIENTO, LO CORRECTO DEBE SER: 12/10/1961 DOCE DE OCTUBRE DE MIL NOVECIENTOS SESENTA Y UNO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 84 OCHENTA Y CUATRO DE LA CALLE MORELOS DE ESTE PUEBLO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SANTA MARIA COIXTEPEC, SANTIAGO XANICA, MIAHUATLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-OMISION DE EL NOMBRE DEL PADRE DE LA REGISTRADA Y DE ACUERDO A LA FIRMA QUE APARECE AL CALCE DEL REGISTRO Y QUE DEL TEXTO SE DESPRENDE LA RELACION CORRECTA CON LOS ABUELOS PATERNOS, LO CORRECTO DEBE SER: FELIX PEREZ PERALTA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-OMISION DE LA NACIONALIDAD DEL PADRE Y DE ACUERDO A LA CONSTANCIA DE ORIGEN Y VECINDAD, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>7OMISION DE DATOS RELATIVOS A LA MADRE Y EN VIRTUD DEL MATRIMONIO SUBSECUENTE DE SUS PADRES, LA ACLARACIÓN ES PROCEDENTE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: REYNA GUADALUPE PEREZ RIOS levantada según registro número 45 de fecha 22 de OCTUBRE de 1961 en SANTA MARIA COIXTEPEC,SANTIAGO XANICA,MIAHUATLAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V, VI,  142, 367, 368 y 369 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I, III y IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SANTA MARIA COIXTEPEC, SANTIAGO XANICA, MIAHUATLAN, OAXACA.- EL NOMBRE DE LA REGISTRADA : REYNA GUADALUPE PEREZ RIOS.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 12/10/1961 DOCE DE OCTUBRE DE MIL NOVECIENTOS SESENTA Y UNO.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SANTA MARIA COIXTEPEC, SANTIAGO XANICA, MIAHUATLAN, OAXACA.- EL NOMBRE DEL PADRE DE LA REGISTRADA : FELIX PEREZ PERALTA.- LA NACIONALIDAD DEL PADRE : MEXICANA.- REYNA GUADALUPE PEREZ RIOS A QUIEN SE REFIERE EL ACTA QUEDO RECONOCIDO(A) Y LEGITIMADO(A) EN VIRTUD DE LOS ARTICULOS 367,368 Y 369 DEL CODIGO CIVIL VIGENTE EN EL ESTADO SEGÚN ACTA DE MATRIMONIO CON NÚMERO DE REGISTRO 222 DE FECHA 01 DE JULIO DE 1981, LEVANTADA EN MIAHUATLAN DE PORFIRIO DIAZ, MIAHUATLAN DE PORFIRIO DIAZ ,MIAHUATLAN.-EL NOMBRE DE LA MADRE: ELENA RIOS PERALTA.-LA EDAD DE LA MADRE AL MOMENTO DEL REGISTRO: 35.-LA NACIONALIDAD DE LA MADRE: MEXICANA.-EL NOMBRE DEL ABUELO MATERNO: JUAN RIOS.-LA NACIONALIDAD DEL ABUELO MATERNO: MEXICANA.-EL NOMBRE DE LA ABUELA MATERNA: EULALIA PERALTA.-LA NACIONALIDAD DE LA ABUELA MATERNA: MEXICANA.- Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por JORAM DIEGO RIOS PEREZ a favor del registrado .-Expediente Número 7994/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SAN PEDRO POCHUTLA, POCHUTLA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGM');
