fy; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO 31 DE ABRIL DE 1997 Y DE ACUERDO A EL CALENDARIO PERPETUO, YA QUE EL MES DE ABRIL UNICAMENTE TIENE 30 DIAS , LO CORRECTO DEBE SER: 30/04/1997 TREINTA DE ABRIL DE MIL NOVECIENTOS NOVENTA Y SIETE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: EZEQUIEL  VARGAS  SARMIENTO  levantada según registro número 43 de fecha 16 de AGOSTO de 1997 en SAN JUAN PETLAPA,CHOAPAM,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: LA FECHA DE NACIMIENTO DEL REGISTRADO : 30/04/1997 TREINTA DE ABRIL DE MIL NOVECIENTOS NOVENTA Y SIETE.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por EZEQUIEL VARGAS SARMIENTO  a favor del registrado .-Expediente Número 8001/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SANTIAGO CHOAPAM, CHOAPAM, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/VSM');
INSERT INTO `nota` VALUES ('110', null, '2016', '8002', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a LUCIA HERNANDEZ SUAREZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO TUXTEPEC, TUXTEPEC Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS DE LA ENTIDAD, LO CORRECTO DEBE SER: SAN JUAN BAUTISTA TUXTEPEC, TUXTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO LUCIA EN EL TEXTO DEL ACTA Y EN LA PARTE SUPERIOR DEL ACTA HERNANDEZ SUAREZ LUCIA Y DE ACUERDO A QUE EL PRIMER APELLIDO LE CORESPONDE LEGALMENTE POR HABER SIDO EL PROGENITOR QUIEN COMPARECIO AL REGISTRO DE NACIMIENTO Y EL SEGUNDO SE APLICA DE ACUERDO AL ARTÍCULO 141 FRACCIÓN VI SEGUNDA PARTE DE CÓDIGO CIVIL DEL ESTADO, LA CUAL SEÑALA QUE PROCEDE LA ACLARACIÓN DEL ACTA PARA EL SOLO EFECTO DE AGREGAR EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION, POR LO QUE EL NOMBRE COMPLETO Y CORRECTO DEBE SER:  LUCIA HERNANDEZ SUAREZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 13 DE DICIEMBRE DE1958 Y DE ACUERDO A QUE LO CORRECTO ES CON NUMERO Y LETRA, LO CORRECTO DEBE SER: 13/12/1958 TRECE DE DICIEMBRE DE MIL NOVECIENTOS CINCUENTA Y OCHO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: LUCIA HERNANDEZ SUAREZ levantada según registro número 1480 de fecha 28 de JULIO de 1973 en SAN JUAN BAUTISTA TUXTEPEC,TUXTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V, VI segunda parte,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN JUAN BAUTISTA TUXTEPEC, TUXTEPEC, OAXACA.- SE AGREGA EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION Y EL NOMBRE COMPLETO Y CORRECTO DEBE SER: LUCIA HERNANDEZ SUAREZ.-LA FECHA DE NACIMIENTO DE LA REGISTRADA : 13/12/1958 TRECE DE DICIEMBRE DE MIL NOVECIENTOS CINCUENTA Y OCHO.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por LUCIA HERNANDEZ SUAREZ por su propio derecho .-Expediente Número 8002/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de PRIMERA OFICIALIA DE SAN JUAN BAUTISTA TUXTEPEC, TUXTEPEC, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('111', null, '2016', '8004', '\0', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 22 de FEBRERO de 1997</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>');
INSERT INTO `nota` VALUES ('112', null, '2016', '7999', 'A', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a ROSALIA VALENTINA LUNA BAUTISTA promoviendo por su propio derecho.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION PARCIAL DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. OMISION DE EL ESTADO BIOLOGICO.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-OMISION PARCIAL DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL PUEBLO DE LUVINA MUNICIPIO DE MACUILTIANGUIS DISTRITO DE IXTLAN DE JUAREZ Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN JUAN LUVINA, SAN PABLO MACUILTIANGUIS, IXTLAN DE JUAREZ, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO ROSALIA BALENTINA LUNA Y DE ACUERDO A A LAS REGLAS DE ORTOGRAFICAS POR EL SEGUNDO NOMBRE PROPIO Y A LA RELACION DE FILIACION QUE EXISTE ENTRE LOS PADRES Y  LA REGISTRADA, LO CORRECTO DEBE SER: ROSALIA VALENTINA LUNA BAUTISTA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO DEL DIA DE LA FECHA Y DE ACUERDO A QUE NACIO EL MISMO DIA DE REGISTRO Y A LA RELACION LOGICA QUE EXISTE ENTRE AMBAS FECHAS, LO CORRECTO DEBE SER: 19/03/1949 DIECINUEVE DE MARZO DE MIL NOVECIENTOS CUARENTA Y NUEVE</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 11 ONCE EN LA CALLE DE BENITO JUAREZ  Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN JUAN LUVINA, SAN PABLO MACUILTIANGUIS, IXTLAN DE JUAREZ, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">5.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE LA MISMA REGISTRADA PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: ROSALIA VALENTINA LUNA BAUTISTA levantada seg&uacute;n registro n&uacute;mero 6 de fecha 19 de MARZO de 1949 en SAN JUAN LUVINA,SAN PABLO MACUILTIANGUIS,IXTLAN DE JUAREZ,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN JUAN LUVINA, SAN PABLO MACUILTIANGUIS, IXTLAN DE JUAREZ, OAXACA.- EL NOMBRE DE LA REGISTRADA : ROSALIA VALENTINA LUNA BAUTISTA.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 19/03/1949 DIECINUEVE DE MARZO DE MIL NOVECIENTOS CUARENTA Y NUEVE.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SAN JUAN LUVINA, SAN PABLO MACUILTIANGUIS, IXTLAN DE JUAREZ, OAXACA.- EL ESTADO BIOLOGICO : VIVA.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ROSALIA VALENTINA LUNA BAUTISTA por su propio derecho .-Expediente N&uacute;mero 7999/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. OFICIAL DEL REGISTRO CIVIL DE IXTLAN DE JUAREZ, IXTLAN DE JUAREZ, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/EAS</p>');
INSERT INTO `nota` VALUES ('113', null, '2016', '8000', 'O', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a EUSTOLIA GISELA BERNAL LOPEZ promoviendo a favor de MARIELA LIZETH GALLARDO BERNAL</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL APELLIDO MATERNO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL APELLIDO PATERNO DE LA MADRE DE LA REGISTRADA.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-ERROR DE ESCRITURA DE EL APELLIDO MATERNO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO BARNAL Y DE ACUERDO A LAS REGLAS ORTOGRAFICAS DE ESCRITURA, LO CORRECTO DEBE SER: BERNAL</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-ERROR DE ESCRITURA DE EL APELLIDO PATERNO DE LA MADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO BARNAL Y DE ACUERDO A EL ACTA DE NACIMIENTO DE LA MADRE, LO CORRECTO DEBE SER: BERNAL</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: MARIELA LIZETH GALLARDO BERNAL levantada seg&uacute;n registro n&uacute;mero 127 de fecha 03 de FEBRERO de 2011 en SANTIAGO PINOTEPA NACIONAL,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 68 FRACCIONES V,  141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. II y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL APELLIDO MATERNO DE LA REGISTRADA : BERNAL.- EL APELLIDO PATERNO DE LA MADRE DE LA REGISTRADA : BERNAL.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por EUSTOLIA GISELA BERNAL LOPEZ a favor del registrado .-Expediente N&uacute;mero 8000/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. Oficial del Registro Civil de SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MARTINEZ MORALES</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/LPP</p>');
INSERT INTO `nota` VALUES ('114', null, '2016', '8008', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a FELIX ARTURO PEÑA JOSE promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL CONTRAYENTE. OMISION DE LA NACIONALIDAD DE LOS CONTRAYENTES. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE MATRIMONIO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CIUDAD DE EJUTLA DE CRESPO DISTRITO DE EJUTLA ESTADO DE OAXACA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: HEROICA CIUDAD DE EJUTLA DE CRESPO, EJUTLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL CONTRAYENTE, TENEMOS QUE APARECE ASENTADO(A) COMO FELIX JOSE PEÑA Y DE ACUERDO A LA FOTOCOPIA DE NACIMIENTO ANTERIOR DEL CONTRAYENTE , LO CORRECTO DEBE SER: FELIX ARTURO JOSE PEÑA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION DE LA NACIONALIDAD DE LOS CONTRAYENTES Y DE ACUERDO A QUE DEL MISMO TEXTO SE DESPRENDE EL ORIGEN DE LOS MISMOS, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de MATRIMONIO de: FELIX ARTURO PEÑA JOSE levantada según registro número 42 de fecha 13 de JULIO de 1966 en HEROICA CIUDAD DE EJUTLA DE CRESPO,EJUTLA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : HEROICA CIUDAD DE EJUTLA DE CRESPO, EJUTLA, OAXACA.- EL NOMBRE DEL CONTRAYENTE : FELIX ARTURO JOSE PEÑA.- LA NACIONALIDAD DE LOS CONTRAYENTES : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por FELIX ARTURO PEÑA JOSE por su propio derecho .-Expediente Número 8008/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de H. CIUDAD DE EJUTLA DE CRESPO, EJUTLA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGM');
INSERT INTO `nota` VALUES ('115', null, '2016', '8009', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a LUCIA NATALI GOMEZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE LA EDAD DEL PADRE. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE LA EDAD DEL PADRE, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL REGISTRO DE LA OFICIALIA COMO 20 AÑOS Y EN EL REGISTRO DEL ARCHIVO CENTRAL COMO 220 Y DE ACUERDO A EL ACTA DE NACIMIENTO DEL PADRE, LO CORRECTO DEBE SER: 20 AÑOS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA PRIMERA SECCION, SANTIAGO TEXTITLAN, OAXACA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SANTIAGO TEXTITLAN, SOLA DE VEGA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: LUCIA NATALI GOMEZ levantada según registro número 27 de fecha 12 de ABRIL de 1985 en SANTIAGO TEXTITLAN,SOLA DE VEGA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: LA EDAD DEL PADRE : 20 AÑOS.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SANTIAGO TEXTITLAN, SOLA DE VEGA, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por LUCIA NATALI GOMEZ por su propio derecho .-Expediente Número 8009/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE SANTIAGO TEXTITLAN, SOLA DE VEGA, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/BMI');
INSERT INTO `nota` VALUES ('119', null, '2016', '8011', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a REY DE JESUS PACHECO CRUZ promoviendo a favor de DOLORES DE JESUS CRUZ GOMEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION PARCIAL DE LA FECHA DE REGISTRO. ERROR DE ESCRITURA DE EL SEXO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION PARCIAL DE LA FECHA DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO 20 DE MARZO DE 1959 Y DE ACUERDO A LAS REGLAS DE ESCRITURA, LO CORRECTO DEBE SER: 20/03/1959 VEINTE DE MARZO DE MIL NOVECIENTOS CINCUENTA Y NUEVE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL SEXO, TENEMOS QUE APARECE ASENTADO(A) COMO NIÑA Y DE ACUERDO A EL NOMBRE PROPIO DE LA REGISTRADA, LO CORRECTO DEBE SER: FEMENINO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO GOMEZ CRUZ DE JESUS DOLOREZ EN LA PARTE SUPERIOR Y EN EL TEXTO DEL ACTA DOLORES DE JESUS CRUZ GOMEZ Y DE ACUERDO A LOS NOMBRES PROPIOS QUE SE ENCUENTRAN EN  EL TEXTO DEL ACTA Y A LA RELACION DE FILIACION QUE EXISTE ENTRE LOS PADRES Y LA REGISTRADA, LO CORRECTO DEBE SER: DOLORES DE JESUS CRUZ GOMEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 20 DE MARZO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 20/03/1959 VEINTE DE MARZO DE MIL NOVECIENTOS CINCUENTA Y NUEVE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA SIN NUMERO DOMICILIO BIEN CONOCIDO EN ESTE PUEBLO Y DE ACUERDO A QUE EL NACIMIENTO OCURRIO EN EL MISMO LUGAR DE REGISTRO, LO CORRECTO DEBE SER: SANTIAGO TENANGO, ETLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: DOLORES DE JESUS CRUZ GOMEZ levantada según registro número 10 de fecha 20 de MARZO de 1959 en SANTIAGO TENANGO,ETLA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES III,  141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: LA FECHA DE REGISTRO : 20/03/1959 VEINTE DE MARZO DE MIL NOVECIENTOS CINCUENTA Y NUEVE.- EL SEXO : FEMENINO.- EL NOMBRE DE LA REGISTRADA : DOLORES DE JESUS CRUZ GOMEZ.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 20/03/1959 VEINTE DE MARZO DE MIL NOVECIENTOS CINCUENTA Y NUEVE.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SANTIAGO TENANGO, ETLA, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por REY DE JESUS PACHECO CRUZ a favor del registrado .-Expediente Número 8011/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE SAN FRANCISCO TELIXTLAHUCA, ETLA, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/CCC');
INSERT INTO `nota` VALUES ('120', null, '2016', '8010', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ENOC RUBEN RAMIREZ LUNA promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. OMISION DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DEL REGISTRADO. ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DEL REGISTRADO. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA ABUELA PATERNA. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA ABUELA MATERNA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO SAN MIGUEL ETLA EX DISTRITO DE ETLA Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN MIGUEL ETLA, SAN JUAN BAUTISTA GUELACHE, ETLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE EL MISMO REGISTRADO PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO ENOC RUBEN RAMIREZ EN EL TEXTO Y EN LA PARTE SUPERIOR DEL ACTA RAMIREZ ENOC RUBEN Y DE ACUERDO A LA RELACION DE FILIACIÓN QUE EXISTE ENTRE LOS PROGENITORES Y EL REGISTRADO, LO CORRECTO DEBE SER: ENOC RUBEN RAMIREZ LUNA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DIA 3 DE ENERO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 03/01/1953 TRES DE ENERO DE MIL NOVECIENTOS CINCUENTA Y TRES </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU DOMICILIO CASA NUMERO 1 Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN MIGUEL ETLA, SAN JUAN BAUTISTA GUELACHE, ETLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO RUBEN RAMIREZ Y DE ACUERDO A QUE SE DESPREN DEL TEXTO DEL ACTA EN BASE A LOS APELLIDOS DE LOS ABUELOS PATERNOS DEL REGISTRADO, LO CORRECTO DEBE SER: RUBEN RAMIREZ DIAZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>7.-ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO ORTENCIA LUNA Y DE ACUERDO A LOS APELLIDOS DE LOS ABUELOS MATERNOS DEL REGISTRADO, LO CORRECTO DEBE SER: HORTENCIA LUNA SANCHEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>8.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA ABUELA PATERNA, TENEMOS QUE APARECE ASENTADO(A) COMO DIAS Y DE ACUERDO A QUE ASI LO ESTABLECEN LAS REGLAS ORTOGRAFICAS Y DE ESCRITURA QUE RIGEN AL IDIOMA ESPAÑOL, LO CORRECTO DEBE SER: DIAZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>9.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA ABUELA MATERNA, TENEMOS QUE APARECE ASENTADO(A) COMO SANCHES Y DE ACUERDO A LAS REGLAS DE ESCRITURA Y DE ORTOGRAFÍA QUE NOS RIGEN, LO CORRECTO DEBE SER: SANCHEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ENOC RUBEN RAMIREZ LUNA levantada según registro número 1 de fecha 15 de ENERO de 1953 en SAN MIGUEL ETLA,SAN JUAN BAUTISTA GUELACHE,ETLA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES I, III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 32, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN MIGUEL ETLA, SAN JUAN BAUTISTA GUELACHE, ETLA, OAXACA.- EL ESTADO BIOLOGICO : VIVO.- EL NOMBRE DEL REGISTRADO : ENOC RUBEN RAMIREZ LUNA.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 03/01/1953 TRES DE ENERO DE MIL NOVECIENTOS CINCUENTA Y TRES.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN MIGUEL ETLA, SAN JUAN BAUTISTA GUELACHE, ETLA, OAXACA.- EL NOMBRE DEL PADRE DEL REGISTRADO : RUBEN RAMIREZ DIAZ.- EL NOMBRE DE LA MADRE DEL REGISTRADO : HORTENCIA LUNA SANCHEZ.- EL APELLIDO PATERNO DE LA ABUELA PATERNA : DIAZ.- EL APELLIDO PATERNO DE LA ABUELA MATERNA : SANCHEZ.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ENOC RUBEN RAMIREZ LUNA por su propio derecho .-Expediente Número 8010/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de VILLA DE ETLA, ETLA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('121', null, '2016', '8012', '\0', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 24 de ABRIL de 1951</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a PAULA RODOLFA CASTELLANOS ORDOÑEZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL PUEBLO DE TLACAMAMA DEL DISTRITO DE JAMILTEPEC, ESTADO DE OAXACA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN MIGUEL TLACAMAMA, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: PAULA RODOLFA CASTELLANOS ORDOÑEZ levantada según registro número 29 de fecha 24 de ABRIL de 1951 en SAN MIGUEL TLACAMAMA,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN MIGUEL TLACAMAMA, JAMILTEPEC, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por PAULA RODOLFA CASTELLANOS ORDOÑEZ por su propio derecho .-Expediente Número 8012/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MARTINEZ MORALES</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/');
INSERT INTO `nota` VALUES ('127', null, '2016', '8014', 'O', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a CONCEPCION LOPEZ GARCIA promoviendo por su propio derecho.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION PARCIAL DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-OMISION PARCIAL DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN QUILITONGO SAN PEDRO EX DISTRITO DE NOCHIXTLAN Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN PEDRO QUILITONGO, ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO LOPEZ CONCEPCION EN EL ENCABEZADO Y EN EL TEXTO CONSEPCION; SE ACLARA EL NOMBRE PROPIO DE ACUERDO A LAS REGLAS ORTOGRAFICAS Y AL ENCABEZADO DEL ACTA, LE CORRESPONDE EL PRIMER APELLIDO A LA RELACION DE FILIACION QUE EXISTE ENTRE EL PADRE Y LA REGISTRADA, SE AGREGA EL SEGUNDO APELLIDO SEGUN LA REFORMA AL ARTICULO 141 FRACCION VI SEGUNDA PARTE DEL CODIGO CIVIL VIGENTE EN EL ESTADO, PARA EL UNICO EFECTO DE QUE SE AGREGUE ESTE ULTIMO AL YA EXISTENTE, SIN CREAR FILIACION, ASI COMO UTILIZA SUS DOCUMENTOS PUBLICOS Y PRIVADOS, &nbsp;LO CORRECTO DEBE SER: CONCEPCION LOPEZ GARCIA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO AYER  Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 07/12/1936 SIETE DE DICIEMBRE DE MIL NOVECIENTOS TREINTA Y SEIS</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU DOMICILIO NUMERO 6 SEIS CALLE 1 DE ALDAMA  Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN PEDRO QUILITONGO, ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">5.-CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE POR LO QUE SE PROCEDE A TESTAR DE OFICIO.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: CONCEPCION LOPEZ GARCIA levantada seg&uacute;n registro n&uacute;mero 14 de fecha 08 de DICIEMBRE de 1936 en SAN PEDRO QUILITONGO,ASUNCION NOCHIXTLAN,NOCHIXTLAN,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 141 FRACCIONES III, V, &nbsp;VI segunda parte y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN PEDRO QUILITONGO, ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA.- SE AGREGA EL SEGUNDO APELLIDO POR SIMPLE USO, SIN CREAR FILIACION, EL NOMBRE DE LA REGISTRADA COMPLETO Y CORRECTO: CONCEPCION LOPEZ GARCIA.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 07/12/1936 SIETE DE DICIEMBRE DE MIL NOVECIENTOS TREINTA Y SEIS.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SAN PEDRO QUILITONGO, ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA.- CON FUNDAMENTO EN EL ARTICULO 385 PARRAFO I DEL CODIGO CIVIL VIGENTE EN EL ESTADO SE AUTORIZA TESTAR DE OFICIO LOS DATOS RELATIVOS A LA MADRE, EN VIRTUD DE QUE UNICAMENTE EXISTE FILIACION ENTRE EL PADRE Y LA REGISTRADA.- Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por CONCEPCION LOPEZ GARCIA por su propio derecho .-Expediente N&uacute;mero 8014/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. Oficial del Registro Civil de ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/EAS</p>');
INSERT INTO `nota` VALUES ('128', null, '2016', '8017', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a FELIPE PRIETO LOPEZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE EL MISMO REGISTRADO PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO FELIPE PRIETO LOPEZ EN EL TEXTO Y EN LA PARTE SUPERIOR DEL ACTA LOPEZ PRIETO FELIPE Y DE ACUERDO A LA RELACION DE FILIACIÓN QUE EXISTE ENTRE LOS PROGENITORES Y EL REGISTRADO, LO CORRECTO DEBE SER: FELIPE PRIETO LOPEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DIA 23 DE AGOSTO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 23/08/1956 VEINTITRES DE AGOSTO DE MIL NOVECIENTOS CINCUENTA SEIS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 4 DE LA AGENCIA SAN ISIDRO Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN ISIDRO, SAN ANDRES ZAUTLA, ETLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: FELIPE PRIETO LOPEZ levantada según registro número 48 de fecha 24 de AGOSTO de 1956 en SAN ANDRES ZAUTLA,ETLA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL ESTADO BIOLOGICO : VIVO.- EL NOMBRE DEL REGISTRADO : FELIPE PRIETO LOPEZ.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 23/08/1956 VEINTITRES DE AGOSTO DE MIL NOVECIENTOS CINCUENTA SEIS.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN ISIDRO, SAN ANDRES ZAUTLA, ETLA, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por FELIPE PRIETO LOPEZ por su propio derecho .-Expediente Número 8017/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de REYES ETLA, ETLA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('131', null, '2016', '8003', 'C', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a RUFINO MARTINEZ CABALLERO promoviendo a favor de LORENZO CRISOFORO MENDOZA REYES</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\"><span style=\"font-size: 8pt; line-height: 1em;\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</span></p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\"><span style=\"font-size: 8pt; line-height: 1em;\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\"><span style=\"font-size: 8pt; line-height: 1em;\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS. OMISION DE DATOS RELATIVOS A LA MADRE.</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\"><span style=\"font-size: 8pt; line-height: 1em;\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</span></p>\r\n<span style=\"font-size: 8pt; line-height: 1em;\">1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL MUNICIPIO DE SAN MATEO SINDIHUI Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGOR&Iacute;AS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO MENDOZA LORENZO CRISOFORO EN LA PARTE SUPERIOR Y CRISOFORO LORENZO EN EL TEXTO Y DE ACUERDO A EL RECONOCIMIENTO QUE ENSEGUIDA SE DETALLARA, LO CORRECTO DEBE SER: CRISOFORO LORENZO MENDOZA REYES</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO 12 DOCE DEL PRESENTE MES Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 12/05/1959 DOCE DE MAYO DE MIL NOVECIENTOS CINCUENTA Y NUEVE</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 174 DE LAS CALLES DE ALDAMA Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">5.-CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS POR LO QUE SE PROCEDE A TESTAR DE OFICIO.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">6.-OMISION DE DATOS RELATIVOS A LA MADRE, Y DE ACUERDO AL ACTA DE RECONOCIMIENTO EXHIBIDA, QUEDA RECONOCIDO(A) POR SU MADRE, POR TAL RAZ&Oacute;N LA ACLARACI&Oacute;N ES PROCEDENTE</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;<span style=\"font-size: 8pt; line-height: 1em;\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;<span style=\"font-size: 8pt; line-height: 1em; text-align: center;\">R  E  S  U  E  L  V  E</span><span style=\"font-size: 8pt; line-height: 1em; text-align: justify;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;<span style=\"font-size: 8pt; line-height: 1em;\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: LORENZO CRISOFORO MENDOZA REYES levantada seg&uacute;n registro n&uacute;mero 11 de fecha 12 de MAYO de 1959 en SAN MATEO SINDIHUI,NOCHIXTLAN,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 84, 85, 141 FRACCIONES III, V, VI,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA.- EL NOMBRE DEL REGISTRADO DE ACUERDO AL RECONOCIMIENTO QUE ENSEGUIDA SE DETALLARA : CRISOFORO LORENZO MENDOZA REYES.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 12/05/1959 DOCE DE MAYO DE MIL NOVECIENTOS CINCUENTA Y NUEVE.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA.- CON FUNDAMENTO EN EL ARTICULO 385 PARRAFO I DEL CODIGO CIVIL VIGENTE EN EL ESTADO SE AUTORIZA TESTAR DE OFICIO LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS, EN VIRTUD DE QUE UNICAMENTE EXISTE RELACION DE FILIACION ENTRE EL PADRE Y EL REGISTRADO.- CON FUNDAMNETO EN EL ARTICULO 84 DEL CODIGO CIVIL VIGENTE EN EL ESTADO: LA PERSONA A QUIEN SE REFIERE EL ACTA QUEDO RECONOCIDO(A) POR SU MADRE SEG&Uacute;N ACTA DE RECONOCIMIENTO CON N&Uacute;MERO DE REGISTRO 8 DE FECHA 27 DE ENERO DE 2000, LEVANTADA EN ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA. EL NOMBRE DE LA MADRE: DOMINGA REYES HERNANDEZ.-LA EDAD DE LA MADRE AL MOMENTO DEL REGISTRO: 22 VEINTIDOS A&Ntilde;OS.-LA NACIONALIDAD DE LA MADRE: MEXICANA.- Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por RUFINO MARTINEZ CABALLERO a favor del registrado .-Expediente N&uacute;mero 8003/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;<span style=\"font-size: 8pt; line-height: 1em;\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;<span style=\"font-size: 8pt; line-height: 1em;\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;<span style=\"font-size: 8pt; line-height: 1em;\">LIC. IGNACIO MANUEL MARTINEZ MORALES</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;<span style=\"font-size: 8pt; line-height: 1em;\">IMM/LGP</span></p>');
INSERT INTO `nota` VALUES ('132', null, '2016', '8003', 'O', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a RUFINO MARTINEZ CABALLERO promoviendo a favor de LORENZO CRISOFORO MENDOZA REYES</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS. OMISION PARCIAL DE LA EDAD DE LA MADRE.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL MUNICIPIO DE SAN MATEO SINDIHUI Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGOR&Iacute;AS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO MENDOZA LORENZO CRISOFORO EN LA PARTE SUPERIOR, CRISOFORO LORENZO EN EL TEXTO Y EN LA ANOTACION MARGINAL DE RECONOCIMIENTO Y DE ACUERDO A QUE SE DEDUCE DE LA ANOTACION MARGINAL DE RECONOCIMIENTO QUE OBRA EN LA FOTOCOPIA DEL LIBRO DE LA OFICIALIA, LO CORRECTO DEBE SER: LORENZO CRISOFORO MENDOZA REYES</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO 12 DOCE DEL PRESENTE MES Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 12/05/1959 DOCE DE MAYO DE MIL NOVECIENTOS CINCUENTA Y NUEVE</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 174 DE LAS CALLES DE ALDAMA Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">5.-CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS POR LO QUE SE PROCEDE A TESTAR DE OFICIO.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">6.-OMISION PARCIAL DE LA EDAD DE LA MADRE, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA ANOTACION MARGINAL Y DE ACUERDO A QUE SE DEDUCE DEL ACTA DE RECONOCIMIENTO, LO CORRECTO DEBE SER AL MOMENTO DEL REGISTRO: 22 VEINTIDOS A&Ntilde;OS</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: LORENZO CRISOFORO MENDOZA REYES levantada seg&uacute;n registro n&uacute;mero 11 de fecha 12 de MAYO de 1959 en SAN MATEO SINDIHUI,NOCHIXTLAN,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA.- EL NOMBRE DEL REGISTRADO TANTO EN EL TEXTO COMO EN LA ANOTACION MARGINAL DE RECONOCIMIENTO: LORENZO CRISOFORO MENDOZA REYES.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 12/05/1959 DOCE DE MAYO DE MIL NOVECIENTOS CINCUENTA Y NUEVE.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA.- CON FUNDAMENTO EN EL ARTICULO 385 PARRAFO I DEL CODIGO CIVIL VIGENTE EN EL ESTADO SE AUTORIZA TESTAR DE OFICIO LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS, EN VIRTU DE QUE UNICAMENTE EXISTE RELACION DE FILIACION ENTRE EL PADRE Y EL REGISTRADO. PARA QUE SURTA SUS EFECTOS LA ANOTACION MARGINAL DE RECONOCIMIENTO.-LA EDAD DE LA MADRE AL MOMENTO DEL REGISTRO: 22 VEINTIDOS A&Ntilde;OS.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por RUFINO MARTINEZ CABALLERO a favor del registrado .-Expediente N&uacute;mero 8003/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. Oficial del Registro Civil de YUTANDUCHI DE GUERRERO, NOCHIXTLAN, OAXACA, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MARTINEZ MORALES</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/LGP</p>');
INSERT INTO `nota` VALUES ('136', null, '2016', '8007', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a MARIA SARA GOMEZ GALAN promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. OMISION DE EL ESTADO BIOLOGICO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL PADRE DE LA REGISTRADA. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL ABUELO PATERNO. OMISION DE LA NACIONALIDAD DE LOS PADRES. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL PUEBLO DE SAN SEBASTIAN ABASOLO EX DISTRITO DE TLACOLULA Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS DE LA ENTIDAD, LO CORRECTO DEBE SER: SAN SEBASTIAN ABASOLO, TLACOLULA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO MARIA SARA GALAN EN EL TEXTO Y GALAN GOMEZ MARIA SARA Y DE ACUERDO A LA RELACION  DE FILIACION QUE EXISTE ENTRE LOS PROGENITORES Y LA REGISTRADA, LO CORRECTO DEBE SER: MARIA SARA GALAN GOMEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE LA MISMA REGISTRADA PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 12 DOCE DEL ACTUAL Y DE ACUERDO A QUE EXISTE RELACION LOGICA ENTRE LA FECHA DE REGISTRO Y LA DE NACIMIENTO, LO CORRECTO DEBE SER: 12/09/1956 DOCE DE SEPTIEMBRE DE MIL NOVECIENTOS CINCUENTA Y SEIS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA DEL DECLARANTE Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN SEBASTIAN ABASOLO, TLACOLULA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL PADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO GOMEZ EN LA FOTOCOPIA DEL LIBRO DEL ARCHIVO CENTRAL Y GOMES EN EL LIBRO DE LA OFICIALIA Y DE ACUERDO A LAS REGLAS DE ORTOGRAFIA QUE NOS RIGEN,  ASI COMO FOTOCOPIA DEL LIBRO QUE OBRA EN EL ARCHIVO CENTRAL POR LO QUE SE IGUALAN EJEMPLARES, LO CORRECTO DEBE SER: GOMEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>7.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL ABUELO PATERNO, TENEMOS QUE APARECE ASENTADO(A) COMO GOMEZ EN EL LIBRO QUE OBRA EN EL ARCHIVO CENTRAL Y GOMES EN LA FOTOCOPIA DEL LIBRO DE LA OFICIALIA Y DE ACUERDO A LAS REGLAS DE ORTOGRAFIA QUE NOS RIGEN,  ASI COMO FOTOCOPIA DEL LIBRO QUE OBRA EN EL ARCHIVO CENTRAL POR LO QUE SE IGUALAN EJEMPLARES, LO CORRECTO DEBE SER: GOMEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>8.-OMISION DE LA NACIONALIDAD DE LOS PADRES Y DE ACUERDO A QUE SE DEDUCE DE LA CONSTANCIA DE ORIGEN Y VECINDAD, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: MARIA SARA GOMEZ GALAN levantada según registro número 38 de fecha 14 de SEPTIEMBRE de 1956 en SAN SEBASTIAN ABASOLO,TLACOLULA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES I, III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 32, 35 y 37 Fracc. I, III y IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN SEBASTIAN ABASOLO, TLACOLULA, OAXACA.- EL NOMBRE DE LA REGISTRADA : MARIA SARA GALAN GOMEZ.- EL ESTADO BIOLOGICO : VIVA.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 12/09/1956 DOCE DE SEPTIEMBRE DE MIL NOVECIENTOS CINCUENTA Y SEIS.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SAN SEBASTIAN ABASOLO, TLACOLULA, OAXACA.- EL APELLIDO PATERNO DEL PADRE DE LA REGISTRADA : GOMEZ.- EL APELLIDO PATERNO DEL ABUELO PATERNO : GOMEZ.- LA NACIONALIDAD DE LOS PADRES : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por MARIA SARA GOMEZ GALAN por su propio derecho .-Expediente Número 8007/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE TLACOLULA DE MATAMOROS, TLACOLULA, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/CCY');
INSERT INTO `nota` VALUES ('138', null, '2016', '8019', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a HILARIO LUIZ RODRIGUEZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO HILARIO EN EL TEXTO Y EN LA PARTE SUPERIOR DEL ACTA LUIZ HILARIO Y DE ACUERDO A QUE EL PRIMER APELLIDO LE CORESPONDE LEGALMENTE POR HABER SIDO EL PROGENITOR QUIEN COMPARECIO AL REGISTRO DE NACIMIENTO Y EL SEGUNDO SE APLICA DE ACUERDO AL ARTÍCULO 141 FRACCIÓN VI SEGUNDA PARTE DE CÓDIGO CIVIL DEL ESTADO, LA CUAL SEÑALA QUE PROCEDE LA ACLARACIÓN DEL ACTA PARA EL SOLO EFECTO DE AGREGAR EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION, POR LO QUE EL NOMBRE COMPLETO Y CORRECTO DEBE SER:  HILARIO LUIZ RODRIGUES </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DIA 5 DEL ACTUAL Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 05/05/1948 CINCO DE MAYO DE MIL NOVECIENTOS CUARENTA Y OCHO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: HILARIO LUIZ RODRIGUEZ levantada según registro número 22 de fecha 05 de MAYO de 1948 en SAN PEDRO TOTOLAPAM,TLACOLULA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES V, VI segunda parte,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: SE AGREGA EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION Y EL NOMBRE COMPLETO Y CORRECTO DEBE SER: HILARIO LUIZ RODRIGUES.-LA FECHA DE NACIMIENTO DEL REGISTRADO : 05/05/1948 CINCO DE MAYO DE MIL NOVECIENTOS CUARENTA Y OCHO.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por HILARIO LUIZ RODRIGUEZ por su propio derecho .-Expediente Número 8019/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SANTIAGO MATATLAN, TLACOLULA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('142', null, '2016', '8018', 'A', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a DIONICIO LOPEZ LOPEZ promoviendo por su propio derecho.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE EL ESTADO BIOLOGICO. OMISION DE EL NOMBRE DE LA MADRE DEL REGISTRADO. OMISION DE LA NACIONALIDAD DE LOS PROGENITORES. ERROR DE ESCRITURA DE EL SEXO. OMISION DE EL(LOS) NOMBRE(S) PROPIO(S) DEL REGISTRADO.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGOR&Iacute;AS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO 19 DEICINUEVE DE OCTUBRE DE 1973 Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 19/10/1973 DIECINUEVE DE OCTUBRE DE MIL NOVECIENTOS SETENTA Y TRES</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA AGENCIA DE POLICIA LA RAYA DE ESTE MUNICIPIO Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: LA RAYA, SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE EL MISMO REGISTRADO PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">5.-OMISION DE EL NOMBRE DE LA MADRE DEL REGISTRADO Y DE ACUERDO A EL NOMBRE QUE SE ENCUENTRA EN EL CASILLERO DEL COMPARECIENTE EN EL EJEMPLAR DE  OFICIALIA Y A LOS APELLIDOS QUE SE DEDUCEN DE LOS ABUELOS MATERNOS DEL REGISTRADO, LO CORRECTO DEBE SER: NARCISA LOPEZ HERNANDEZ</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">6.-OMISION DE LA NACIONALIDAD DE LOS PROGENITORES Y DE ACUERDO A QUE EN EL TEXTO DEL ACTA SE MENCIONA EL ORIGEN DE LOS MISMOS, LO CORRECTO DEBE SER: MEXICANA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">7.-ERROR DE ESCRITURA DE EL SEXO, TENEMOS QUE APARECE ASENTADO(A) COMO NI&Ntilde;O Y DE ACUERDO A EL NOMBRE PROPIO DEL REGISTRADO, LO CORRECTO DEBE SER: MASCULINO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">8.-OMISION DE EL(LOS) NOMBRE(S) PROPIO(S) DEL REGISTRADO Y DE ACUERDO A QUE NO CAMBIA LA PRONUNCIACION DEL NOMBRE Y LO COMPRUEBA CON SUS DOCUMENTOS PUBLICOS Y PRIVADOS, LO CORRECTO DEBE SER: DIONICIO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: DIONICIO LOPEZ LOPEZ levantada seg&uacute;n registro n&uacute;mero 336 de fecha 06 de NOVIEMBRE de 1973 en SANTIAGO PINOTEPA NACIONAL,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 68 FRACCIONES III,  141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I, III y IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 19/10/1973 DIECINUEVE DE OCTUBRE DE MIL NOVECIENTOS SETENTA Y TRES.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : LA RAYA, SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA.- EL ESTADO BIOLOGICO : VIVO.- EL NOMBRE DE LA MADRE DEL REGISTRADO : NARCISA LOPEZ HERNANDEZ.- LA NACIONALIDAD DE LOS PROGENITORES : MEXICANA.- EL SEXO : MASCULINO.- EL(LOS) NOMBRE(S) PROPIO(S) DEL REGISTRADO : DIONICIO.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por DIONICIO LOPEZ LOPEZ por su propio derecho .-Expediente N&uacute;mero 8018/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. OFICIAL DEL REGISTRO CIVIL DE SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\"><span style=\"font-size: 8pt; line-height: 1em;\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\"><span style=\"font-size: 8pt; line-height: 1em;\">LIC. IGNACIO MANUEL MARTINEZ MORALES</span></p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/CCC</p>');
INSERT INTO `nota` VALUES ('143', null, '2016', '8023', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a CONSUELO INES CHAVEZ PEREZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL SEXO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE LA MISMA REGISTRADA PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL SEXO, TENEMOS QUE APARECE ASENTADO(A) COMO NIÑA Y DE ACUERDO A EL NOMBRE PROPIO DE LA REGISTRADA, LO CORRECTO DEBE SER: FEMENINO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMEO 20 Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN FRANCISCO TELIXTLAHUACA, ETLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: CONSUELO INES CHAVEZ PEREZ levantada según registro número 24 de fecha 22 de FEBRERO de 1980 en SAN FRANCISCO TELIXTLAHUACA,ETLA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES III,  141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL ESTADO BIOLOGICO : VIVA.- EL SEXO : FEMENINO.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SAN FRANCISCO TELIXTLAHUACA, ETLA, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por CONSUELO INES CHAVEZ PEREZ por su propio derecho .-Expediente Número 8023/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SAN FRANCISCO TELIXTLAHUCA, ETLA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('144', null, '2016', '8013', 'O', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a LEOVIGILDO NONATO LOPEZ MORALES  promoviendo a favor de LEOVIGILDO NONATO  LOPEZ  MORALES</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION DEL SEGUNDO NOMBRE PROPIO DEL RECONOCIDO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL RECONOCEDOR. ERROR DE ESCRITURA DE EL SEXO DEL RECONOCIDO.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE RECONOCIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-OMISION DEL SEGUNDO &nbsp;NOMBRE PROPIO DEL RECONOCIDO Y DE ACUERDO A A EL ACTA DEL MISMO DE FECHA 31 DE AGOSTO DE 1947, LEVANTADA EN SANTA CRUZ XOXOCOTLAN, CENTRO, OAXACA., LO CORRECTO DEBE SER: NONATO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL RECONOCEDOR, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 28 DE MARTIRES DE TACUBAYA EN ESTA CIUDAD  Y DE ACUERDO A A EL ACTA DE NACIMIENTO DEL MISMO ANTES MENCIONADA , LO CORRECTO DEBE SER: SANTA CRUZ XOXOCOTLAN, CENTRO, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-ERROR DE ESCRITURA DE EL SEXO DEL RECONOCIDO, TENEMOS QUE APARECE ASENTADO(A) COMO HIJO  Y DE ACUERDO A A EL ACTA DE NACIMIENTO DEL MISMO ANTES MENCIONADA , LO CORRECTO DEBE SER: MASCULINO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de RECONOCIMIENTO de: LEOVIGILDO NONATO  LOPEZ  MORALES  levantada seg&uacute;n registro n&uacute;mero 4220 de fecha 05 de OCTUBRE de 1968 en OAXACA DE JUAREZ,CENTRO,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 68 FRACCIONES III,  141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL SEGUNDO NOMBRE PROPIO DEL RECONOCIDO DE ACUERDO A SU ACTA DE NACIMIENTO: NONATO.- EL LUGAR DE NACIMIENTO DEL RECONOCEDOR : SANTA CRUZ XOXOCOTLAN, CENTRO, OAXACA.- EL SEXO DEL RECONOCIDO : MASCULINO .-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por LEOVIGILDO NONATO LOPEZ MORALES  a favor del registrado .-Expediente N&uacute;mero 8013/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. Oficial del Registro Civil de SEGUNDA OFICIALIA DEL CENTRO, CENTRO, OAXACA, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MARTINEZ MORALES</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/VSM</p>');
INSERT INTO `nota` VALUES ('146', null, '2016', '8026', 'O', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a PATRICIA E. MENDEZ SANTA CRUZ promoviendo a favor de ALBERTO  MENDEZ LEON</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL APELLIDO MATERNO DE LA CONTRAYENTE. OMISION DE LA NACIONALIDAD DE LOS CONTRAYENTES.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE MATRIMONIO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CIUDAD DE OAXACA DE JUAREZ Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: OAXACA DE JUAREZ, CENTRO, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-ERROR DE ESCRITURA DE EL APELLIDO MATERNO DE LA CONTRAYENTE, TENEMOS QUE APARECE ASENTADO(A) COMO SANTIBA&Ntilde;EZ(ENMENDADO) EN PARTE SUPERIOR Y SANTILLAN EN EL TEXTO Y DE ACUERDO A QUE DEL MISMO TEXTO SE DESPRENDE LO CORRECTO AL EXISTIR RELACION CON LA MADRE DE LA MISMA, LO CORRECTO DEBE SER: SANTILLAN</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-OMISION DE LA NACIONALIDAD DE LOS CONTRAYENTES Y DE ACUERDO A QUE DEL MISMO TEXTO SE DESPRENDE EL ORIGEN DE LOS MISMOS, LO CORRECTO DEBE SER: MEXICANA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de MATRIMONIO de: ALBERTO  MENDEZ LEON levantada seg&uacute;n registro n&uacute;mero 506 de fecha 16 de AGOSTO de 1954 en OAXACA DE JUAREZ,CENTRO,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culo 68 FRACCIONES V,  141 FRACCIONES 100 Fraccion I, III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : OAXACA DE JUAREZ, CENTRO, OAXACA.- EL APELLIDO MATERNO DE LA CONTRAYENTE CORRECTO ES: SANTILLAN.- LA NACIONALIDAD DE LOS CONTRAYENTES : MEXICANA.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por PATRICIA E. MENDEZ SANTA CRUZ a favor del registrado .-Expediente N&uacute;mero 8026/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. Oficial del Registro Civil de SEGUNDA OFICIALIA DEL CENTRO, CENTRO, OAXACA, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/LGM</p>');
INSERT INTO `nota` VALUES ('147', null, '2016', '8025', 'C', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ANTOLIN SANTIAGO SANTIAGO promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION DE EL ESTADO BIOLOGICO. OMISION DE EL NOMBRE DEL REGISTRADO. OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO. OMISION DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE EL MISMO REGISTRADO PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE EL NOMBRE DEL REGISTRADO Y DE ACUERDO A LA RELACION DE FILIACIÓN QUE EXISTE ENTRE LOS PROGENITORES Y EL REGISTRADO, LO CORRECTO DEBE SER: ANTOLIN SANTIAGO SANTIAGO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A QUE LO CORRECTO ES CON NUMERO Y LETRA, LO CORRECTO DEBE SER: 02/09/1950 DOS DE SEPTIEMBRE DE MIL NOVECIENTOS CINCUENTA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION DE EL LUGAR DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN FRANCISCO IXHUATAN, JUCHITAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ANTOLIN SANTIAGO SANTIAGO levantada según registro número 108 de fecha 18 de SEPTIEMBRE de 1950 en SAN FRANCISCO IXHUATAN,JUCHITAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL ESTADO BIOLOGICO : VIVO.- EL NOMBRE DEL REGISTRADO : ANTOLIN SANTIAGO SANTIAGO.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 02/09/1950 DOS DE SEPTIEMBRE DE MIL NOVECIENTOS CINCUENTA.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN FRANCISCO IXHUATAN, JUCHITAN, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ANTOLIN SANTIAGO SANTIAGO por su propio derecho .-Expediente Número 8025/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
