 BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE EL MISMO REGISTRADO PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE EL NOMBRE DEL REGISTRADO Y DE ACUERDO A LA RELACION DE FILIACIÓN QUE EXISTE ENTRE LOS PROGENITORES Y EL REGISTRADO, LO CORRECTO DEBE SER: ANTOLIN SANTIAGO SANTIAGO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A QUE LO CORRECTO ES CON NUMERO Y LETRA, LO CORRECTO DEBE SER: 02/09/1950 DOS DE SEPTIEMBRE DE MIL NOVECIENTOS CINCUENTA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION DE EL LUGAR DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN FRANCISCO IXHUATAN, JUCHITAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO PAULINA SANTIAGO LIGERAMENTE REMARCADO Y DE ACUERDO A LAS REGLAS DE ESCRITURA Y DE ORTOGRAFÍA QUE NOS RIGEN, LO CORRECTO DEBE SER:  </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ANTOLIN SANTIAGO SANTIAGO levantada según registro número 108 de fecha 18 de SEPTIEMBRE de 1950 en SAN FRANCISCO IXHUATAN,JUCHITAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL ESTADO BIOLOGICO : VIVO.- EL NOMBRE DEL REGISTRADO : ANTOLIN SANTIAGO SANTIAGO.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 02/09/1950 DOS DE SEPTIEMBRE DE MIL NOVECIENTOS CINCUENTA.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN FRANCISCO IXHUATAN, JUCHITAN, OAXACA.- EL NOMBRE DE LA MADRE DEL REGISTRADO : .-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ANTOLIN SANTIAGO SANTIAGO por su propio derecho .-Expediente Número 8025/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SANTO DOMINGO ZANATEPEC, JUCHITAN, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('150', null, '2016', '8028', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a SATURNINO BLAS HERNANDEZ AYONA promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL SEXO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DEL REGISTRADO. OMISION DE LA NACIONALIDAD DE LOS PROGENITORES. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL SEXO, TENEMOS QUE APARECE ASENTADO(A) COMO NIÑO Y DE ACUERDO A EL NOMBRE PROPIO DEL REGISTRADO, LO CORRECTO DEBE SER: MASCULINO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DEL DIA 29 VEINTINUEVE DEL MES DE NOVIEMBRE DE 1972 Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 29/11/1972 VEINTINUEVE DE NOVIEMBRE DE MIL NOVECIENTOS SETENTADOS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA AGENCIA DE POLICIA DE LAGUNILLA DE ESTE MUNICIPIO Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: LAGUNILLAS, SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE EL MISMO REGISTRADO PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO BALBINA AYONA DE HERNANDEZ Y DE ACUERDO A LOS APELLIDOS DE LOS ABUELOS MATERNOS DEL REGISTRADO, LO CORRECTO DEBE SER: BALBINA AYONA ARELLANES </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-OMISION DE LA NACIONALIDAD DE LOS PROGENITORES Y DE ACUERDO A QUE EN EL TEXTO DEL ACTA SE MENCIONA EL ORIGEN DE LOS MISMOS, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: SATURNINO BLAS HERNANDEZ AYONA levantada según registro número 409 de fecha 07 de DICIEMBRE de 1972 en SANTIAGO PINOTEPA NACIONAL,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES III,  141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I, III y IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL SEXO : MASCULINO.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 29/11/1972 VEINTINUEVE DE NOVIEMBRE DE MIL NOVECIENTOS SETENTADOS.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : LAGUNILLAS, SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA.- EL ESTADO BIOLOGICO : VIVO.- EL NOMBRE DE LA MADRE DEL REGISTRADO : BALBINA AYONA ARELLANES.- LA NACIONALIDAD DE LOS PROGENITORES : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por SATURNINO BLAS HERNANDEZ AYONA por su propio derecho .-Expediente Número 8028/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/CCC');
INSERT INTO `nota` VALUES ('152', null, '2016', '8016', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a CARMELA CISNEROS HERRERA promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL NOMBRE DE LA CONTRAYENTE. ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DE LA CONTRAYENTE. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE MATRIMONIO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL NOMBRE DE LA CONTRAYENTE, TENEMOS QUE APARECE ASENTADO(A) COMO CARMELA CIS TACHADO CISNERO HERRERA  Y DE ACUERDO A EL ACTA DE NACIMIENTO DE LA MISMA , LO CORRECTO DEBE SER: CARMELA  CISNEROS HERRERA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DE LA CONTRAYENTE, TENEMOS QUE APARECE ASENTADO(A) COMO ALFREDO CISNERO CORCUERA Y DE ACUERDO A AL ACTA DE NACIMIENTO DE LA CONTRAYENTE DE FECHA ANTERIOR, LO CORRECTO DEBE SER: ALFREDO CISNEROS  CORCUERA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de MATRIMONIO de: CARMELA CISNEROS HERRERA levantada según registro número 205 de fecha 20 de DICIEMBRE de 2002 en SANTA MARIA HUAZOLOTITLAN,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 100 Fraccion I, 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y  del Reglamento del Registro Civil se aclaran los siguientes datos: EL NOMBRE DE LA CONTRAYENTE : CARMELA  CISNEROS HERRERA.- EL NOMBRE DEL PADRE DE LA CONTRAYENTE : ALFREDO CISNEROS  CORCUERA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por CARMELA CISNEROS HERRERA por su propio derecho .-Expediente Número 8016/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SANTA MARIA HUAZOLOTITLAN, JAMILTEPEC, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LPP');
INSERT INTO `nota` VALUES ('153', null, '2016', '8006', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a JULIANA LOPEZ CASTRO promoviendo a favor de VALERIANO LOPEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION PARCIAL DE EL LUGAR DE REGISTRO. OMISION DE EL NOMBRE DEL REGISTRADO. ERROR DE ESCRITURA DE LA HORA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE LA NACIONALIDAD DEL PADRE. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION PARCIAL DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN QUILINTONGO, DISTRITO DE NOCHIXTLAN Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: SAN PEDRO QUILITONGO, ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE EL NOMBRE DEL REGISTRADO Y DE ACUERDO A SE ACLARA EL NOMBRE PROPIO DE ACUERDO A COMO ESTA ESCRITO EN LA PARTE SUPERIOR Y QUE EL PRIMER APELLIDO LE CORRESPONDE LEGALMENTE POR HABER SIDO EL PROGENITOR QUIEN COMPARECIO AL REGISTRO DE NACIMIENTO, LO CORRECTO DEBE SER: VALERIANO LOPEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE LA HORA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO A LAS 5 CINCO DE LA MAÑANA Y DE ACUERDO A LO QUE SE DEDUCE DEL TEXTO DEL ACTA, LO CORRECTO DEBE SER: 05:00 CINCO HORAS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DE AYER Y DE ACUERDO A SE DEDUCE DE LA FECHA DE REGISTRO, AL EXISTIR RELACION CRONOLOGICA ENTRE AMBAS FECHAS, LO CORRECTO DEBE SER: 21/05/1919 VEINTIUNO DE MAYO DE MIL NOVECIENTOS DIECINUEVE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA DE SU HABITACION SITUADA AL NORTE DE ESTE MUNIICPIO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN PEDRO QUILITONGO, ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-OMISION DE LA NACIONALIDAD DEL PADRE Y DE ACUERDO A QUE SE DEDUCE DEL MISMO TEXTO DEL ACTA AL MENCIONAR SU ORIGEN Y VECINDAD Y A LA CONSTANCIA DE ORIGEN Y VECINDAD QUE PRESENTA, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: VALERIANO LOPEZ levantada según registro número 6 de fecha 22 de MAYO de 1919 en SAN PEDRO QUILITONGO,ASUNCION NOCHIXTLAN,NOCHIXTLAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN PEDRO QUILITONGO, ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA.- EL NOMBRE DEL REGISTRADO : VALERIANO LOPEZ.- LA HORA DE NACIMIENTO DEL REGISTRADO : 05:00 CINCO HORAS.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 21/05/1919 VEINTIUNO DE MAYO DE MIL NOVECIENTOS DIECINUEVE.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN PEDRO QUILITONGO, ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA.- LA NACIONALIDAD DEL PADRE : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por JULIANA LOPEZ CASTRO a favor del registrado .-Expediente Número 8006/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/SBS');
INSERT INTO `nota` VALUES ('154', null, '2016', '8021', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a MARIA GARCIA GARCIA promoviendo a favor de ADRIAN GARCIA GARCIA</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL APELLIDO MATERNO DEL PADRE DEL REGISTRADO. ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DEL REGISTRADO. OMISION DE LA NACIONALIDAD DE LOS PROGENITORES. ERROR DE ESCRITURA DE EL(LOS) NOMBRE(S) PROPIO(S) DE LA ABUELA PATERNA. ERROR DE ESCRITURA DE EL(LOS) NOMBRE(S) PROPIO(S) DEL ABUELO MATERNO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA AGENCIA MUNICIPAL DE SANTA MARIA SUCHITLAN, MUNICIPIO DE SINAXTLA DISTRITO DE NOCHIXTLAN Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: SANTA MARIA SUCHIXTLAN, SAN ANDRES SINAXTLA, NOCHIXTLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO ADRIAN EN EL TEXTO Y GARCIA GARCIA ADRIAN EN LA PARTE SUPERIOR Y DE ACUERDO A LA RELACION DE FILIACIÓN QUE EXISTE ENTRE LOS PROGENITORES Y EL REGISTRADO, LO CORRECTO DEBE SER: ADRIAN GARCIA GARCIA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO 8 OCHO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 08/07/1969 OCHO DE JULIO DE MIL NOVECIENTOS SESENTA Y NUEVE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 18 EN LA CALLE DE MORELOS  EN ESTA  POBLACION Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SANTA MARIA SUCHIXTLAN, SAN ANDRES SINAXTLA, NOCHIXTLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL APELLIDO MATERNO DEL PADRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO BEYES Y DE ACUERDO A LAS REGLAS DE ESCRITURA QUE RIGEN AL IDIOMA ESPAÑOL, LO CORRECTO DEBE SER: REYES </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO TERESA GARCIA  EN EL LIBRO DEL ARCHIVO CENTRAL Y TERESA (ENMENDADO ) GARCIA EN EL LIBRO DE LA OFICIALIA Y DE ACUERDO A LA FOTOCOPIA DEL LIBRO DEL ARCHIVO CENTRAL  POR LO QUE SE IGUALAN EJEMPLARES,  ASÍ COMO APELLIDOS PATERNOS DE LOS ABUELOS MATERNOS, LO CORRECTO DEBE SER: TERESA GARCIA RAMIREZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>7.-OMISION DE LA NACIONALIDAD DE LOS PROGENITORES Y DE ACUERDO A QUE EN EL TEXTO DEL ACTA SE MENCIONA EL ORIGEN DE LOS MISMOS, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>8.-ERROR DE ESCRITURA DE EL(LOS) NOMBRE(S) PROPIO(S) DE LA ABUELA PATERNA, TENEMOS QUE APARECE ASENTADO(A) COMO LONITA  EN EL LIBRO DEL ARCHIVO CENTRAL Y LEONILA  EN EL LIBRO DE LA OFICIALIA Y DE ACUERDO A LA FOTOCOPIA DEL LIBRO DE LA OFICIALIA, POR LO QUE SE IGUALAN EJEMPLARES, LO CORRECTO DEBE SER: LEONILA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>9.-ERROR DE ESCRITURA DE EL(LOS) NOMBRE(S) PROPIO(S) DEL ABUELO MATERNO, TENEMOS QUE APARECE ASENTADO(A) COMO PARMEN Y DE ACUERDO A LAS REGLAS DE ESCRITURA QUE RIGEN AL IDIOMA ESPAÑOL, LO CORRECTO DEBE SER: CARMEN </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ADRIAN GARCIA GARCIA levantada según registro número 3 de fecha 30 de JULIO de 1969 en SANTA MARIA SUCHIXTLAN,SAN ANDRES SINAXTLA,NOCHIXTLAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I, III y IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SANTA MARIA SUCHIXTLAN, SAN ANDRES SINAXTLA, NOCHIXTLAN, OAXACA.- EL NOMBRE DEL REGISTRADO : ADRIAN GARCIA GARCIA.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 08/07/1969 OCHO DE JULIO DE MIL NOVECIENTOS SESENTA Y NUEVE.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SANTA MARIA SUCHIXTLAN, SAN ANDRES SINAXTLA, NOCHIXTLAN, OAXACA.- EL APELLIDO MATERNO DEL PADRE DEL REGISTRADO : REYES.- EL NOMBRE DE LA MADRE DEL REGISTRADO : TERESA GARCIA RAMIREZ.- LA NACIONALIDAD DE LOS PROGENITORES : MEXICANA.- EL(LOS) NOMBRE(S) PROPIO(S) DE LA ABUELA PATERNA : LEONILA.- EL(LOS) NOMBRE(S) PROPIO(S) DEL ABUELO MATERNO : CARMEN.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por MARIA GARCIA GARCIA a favor del registrado .-Expediente Número 8021/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/CCY');
INSERT INTO `nota` VALUES ('155', null, '2016', '8027', 'A', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a ISAIAS IGNACIO VAZQUEZ PIMENTEL promoviendo por su propio derecho.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION PARCIAL DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DEL REGISTRADO. ERROR DE ESCRITURA DE EL APELLIDO PATERNO DEL ABUELO PATERNO.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-OMISION PARCIAL DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL PUEBLO DE SANTA MARIA YUCU&Ntilde;ITI MUNICIPIO DE MISMO NOMBRE DISTRITO DE HUAJUAPAM DE LEON  Y DE ACUERDO A EL DECRETO QUE FIJA LA DIVISI&Oacute;N TERRITORIAL DEL ESTADO DE OAXACA ACTUALIZADA, LO CORRECTO DEBE SER: YUCU&Ntilde;UTI DE BENITO JUAREZ, HEROICA VILLA TEZOATLAN DE SEGURA Y LUNA, HUAJUAPAN, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL ENCABEZADO VAZQUEZ YSAIAS YGNACIO Y EN EL TEXTO YSAIAS YGNACIO; SE ACLARA EL NOMBRE PROPIO DE ACUERDO A LAS REGLAS ORTOGRAFICAS, A LA RELACION DE FILIACION QUE EXISTE ENTRE LOS PADRES Y EL REGISTRADO, LO CORRECTO DEBE SER: ISAIAS IGNACIO VAZQUEZ PIMENTEL</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DEL DIA 6 SEIS DEL ACTUAL  Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 06/07/1948 SEIS DE JULIO DE MIL NOVECIENTOS CUARENTA Y OCHO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 2 DOS DE LA 2A DE MATAMOROS Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: YUCU&Ntilde;UTI DE BENITO JUAREZ, HEROICA VILLA TEZOATLAN DE SEGURA Y LUNA, HUAJUAPAN, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">5.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE EL MISMO REGISTRADO PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">6.-ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) EN EL LIBRO DE OFICIALIA DIEGO VASQUEZ HERNANDES Y EN EL LIBRO DE ARCHIVO CENTRAL ENMENDADO EL APELLIDO PATERNO Y INCORRECTA ESCRITURA EN EL APELLIDO MATERNO H, SE ACLARA EL APELLIDO PATERNO DE ACUERDO A QUE SE DEDUCE DEL MISMO TEXTO DEL ACTA POR EL LIBRO DE OFICIALIA IGUALANDO EJEMPLARES Y QUE EL APELLIDO PATERNO SE ESCRIBE INDISTINTAMENTE, LO CORRECTO DEBE SER: DIEGO VAZQUEZ HERNANDEZ</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">7.-ERROR DE ESCRITURA DE EL APELLIDO PATERNO DEL ABUELO PATERNO, TENEMOS QUE APARECE ASENTADO(A) COMO VASQUEZ Y DE ACUERDO A QUE SE ESCRIBE INDISTINTAMENTE, LO CORRECTO DEBE SER: VAZQUEZ</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: ISAIAS IGNACIO VAZQUEZ PIMENTEL levantada seg&uacute;n registro n&uacute;mero 26 de fecha 23 de JULIO de 1948 en YUCU&Ntilde;UTI DE BENITO JUAREZ,HEROICA VILLA TEZOATLAN DE SEGURA Y LUNA,HUAJUAPAN,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 68 FRACCIONES V,  141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : YUCU&Ntilde;UTI DE BENITO JUAREZ, HEROICA VILLA TEZOATLAN DE SEGURA Y LUNA, HUAJUAPAN, OAXACA.- EL NOMBRE DEL REGISTRADO : ISAIAS IGNACIO VAZQUEZ PIMENTEL.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 06/07/1948 SEIS DE JULIO DE MIL NOVECIENTOS CUARENTA Y OCHO.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : YUCU&Ntilde;UTI DE BENITO JUAREZ, HEROICA VILLA TEZOATLAN DE SEGURA Y LUNA, HUAJUAPAN, OAXACA.- EL ESTADO BIOLOGICO : VIVO.- EL NOMBRE DEL PADRE DEL REGISTRADO, SE IGUALA DE ACUERDO AL LIBRO DE OFICIALIA Y REGLAS DE ESCRITURA, SIENDO LO CORRECTO : DIEGO VAZQUEZ HERNANDEZ.- EL APELLIDO PATERNO DEL ABUELO PATERNO : VAZQUEZ.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ISAIAS IGNACIO VAZQUEZ PIMENTEL por su propio derecho .-Expediente N&uacute;mero 8027/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. OFICIAL DEL REGISTRO CIVIL DE TEZOATLAN DE SEGURA Y LUNA, HUAJUAPAN, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/EAS</p>');
INSERT INTO `nota` VALUES ('156', null, '2016', '8030', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ISAAC LOPEZ ARRAZOLA promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO COMINTACHI IXCAPA Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: CAMOTINCHAN, SAN SEBASTIAN IXCAPA, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO ISAAC EN EL TEXTO Y EN LA PARTE SUPERIOR DEL ACTA LOPEZ RASOLA ISAAC Y DE ACUERDO A QUE EL PRIMER APELLIDO LE CORESPONDE LEGALMENTE POR HABER SIDO EL PROGENITOR QUIEN COMPARECIO AL REGISTRO DE NACIMIENTO Y EL SEGUNDO SE APLICA DE ACUERDO AL ARTÍCULO 141 FRACCIÓN VI SEGUNDA PARTE DE CÓDIGO CIVIL DEL ESTADO, LA CUAL SEÑALA QUE PROCEDE LA ACLARACIÓN DEL ACTA PARA EL SOLO EFECTO DE AGREGAR EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION, POR LO QUE EL NOMBRE COMPLETO Y CORRECTO DEBE SER:  ISAAC LOPEZ ARRAZOLA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DIA 3 DE JUNIO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 03/06/1955 TRES DE JUNIO DE MIL NOVECIENTOS CINCUENTA Y CINCO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU DOMICILIO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: CAMOTINCHAN, SAN SEBASTIAN IXCAPA, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS POR LO QUE SE PROCEDE A TESTAR DE OFICIO.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ISAAC LOPEZ ARRAZOLA levantada según registro número 1 de fecha 01 de JULIO de 1955 en CAMOTINCHAN,SAN SEBASTIAN IXCAPA,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V, VI segunda parte,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : CAMOTINCHAN, SAN SEBASTIAN IXCAPA, JAMILTEPEC, OAXACA.- SE AGREGA EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION Y EL NOMBRE COMPLETO Y CORRECTO DEBE SER: ISAAC LOPEZ ARRAZOLA.-LA FECHA DE NACIMIENTO DEL REGISTRADO : 03/06/1955 TRES DE JUNIO DE MIL NOVECIENTOS CINCUENTA Y CINCO.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : CAMOTINCHAN, SAN SEBASTIAN IXCAPA, JAMILTEPEC, OAXACA.- CON FUNDAMENTO EN EL ARTICULO 385 PARRAFO I DEL CODIGO CIVIL VIGENTE EN EL ESTADO SE AUTORIZA TESTAR DE OFICIO LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS.- Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ISAAC LOPEZ ARRAZOLA por su propio derecho .-Expediente Número 8030/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('158', null, '2016', '8031', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a BASILIA VALERIANA NARVAEZ SOLIS promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL SEXO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. OMISION DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DE LA REGISTRADA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL SEXO, TENEMOS QUE APARECE ASENTADO(A) COMO NIÑA Y DE ACUERDO A EL NOMBRE PROPIO DE LA REGISTRADA, LO CORRECTO DEBE SER: FEMENINO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO NARVAEZ SOLIS BASILIA VALERIANA EN LA PARTE SUPERIOR Y EN EL TEXTO DEL ACTA BASILIA VALERIANA Y DE ACUERDO A LA RELACION  DE FILIACION QUE EXISTE ENTRE LOS PROGENITORES Y LA REGISTRADA, LO CORRECTO DEBE SER: BASILIA VALERIANA NARVAEZ SOLIS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO DEL DIA 14 CATORCE DE JUNIO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 14/06/1951 CATORCE DE JUNIO DE MIL NOVECIENTOS CINCUENTA Y UNO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU DOMICILIO UBICADO EN LA SECCION SEGUNDA DE ESTA LOCALIDAD Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE LA MISMA REGISTRADA PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO PRIMITIVA SOLIS DE NARVAEZ EN EL TEXTO DEL ACTA Y EN EL CASILLERO DE LOS PADRES PRIMITIVA SOLIS DE N. Y DE ACUERDO A LOS APELLIDOS DE LOS ABUELOS MATERNOS ASENTADOS EN EL TEXTO DEL ACTA, LO CORRECTO DEBE SER: PRIMITIVA SOLIS PEREZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: BASILIA VALERIANA NARVAEZ SOLIS levantada según registro número 192 de fecha 23 de JUNIO de 1951 en SANTIAGO PINOTEPA NACIONAL,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES III,  141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL SEXO : FEMENINO.- EL NOMBRE DE LA REGISTRADA : BASILIA VALERIANA NARVAEZ SOLIS.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 14/06/1951 CATORCE DE JUNIO DE MIL NOVECIENTOS CINCUENTA Y UNO.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA.- EL ESTADO BIOLOGICO : VIVA.- EL NOMBRE DE LA MADRE DE LA REGISTRADA : PRIMITIVA SOLIS PEREZ.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por BASILIA VALERIANA NARVAEZ SOLIS por su propio derecho .-Expediente Número 8031/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/CCC');
INSERT INTO `nota` VALUES ('159', null, '2016', '8029', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a MARCO OLIVER RAMO ZAPIEN promoviendo a favor de ALFONSO VASALLO ORTIZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. DATO ILEGIBLE DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL SEXO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE LA NACIONALIDAD DE LOS PROGENITORES. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CIUDAD DE MATIAS ROMERO EX DISTRITO DE JUCHITAN DEL ESTADO DE OAXAA Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: MATIAS ROMERO AVENDAÑO, JUCHITAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-DATO ILEGIBLE DE EL ESTADO BIOLOGICO, TENEMOS QUE APARECE ASENTADO(A) COMO  Y DE ACUERDO A LA IDENTIFICACION PERSONAL QUE PRESENTA, LO CORRECTO DEBE SER: VIVO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE EL SEXO, TENEMOS QUE APARECE ASENTADO(A) COMO NIÑO Y DE ACUERDO A EL NOMBRE PROPIO DEL REGISTRADO, LO CORRECTO DEBE SER: MASCULINO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DIEZ DE SEPTIEMBR DEL PRESENTE AÑO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 10/09/1959 DIEZ DE SEPTIEMBRE DE MIL NOVECIENTOS CINCUENTA Y NUEVE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CIUDAD DE MATIAS ROMERO, EX DISTRITO DE JUCHITAN DEL ESTADO DE OAXACA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: MATIAS ROMERO AVENDAÑO, JUCHITAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-OMISION DE LA NACIONALIDAD DE LOS PROGENITORES Y DE ACUERDO A LA CONSTANCIA DE ORIGEN Y VECINDAD QUE SE ANEXA, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ALFONSO VASALLO ORTIZ levantada según registro número 439 de fecha 26 de SEPTIEMBRE de 1959 en MATIAS ROMERO AVENDAÑO,JUCHITAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES III,  141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : MATIAS ROMERO AVENDAÑO, JUCHITAN, OAXACA.- EL ESTADO BIOLOGICO : VIVO.- EL SEXO : MASCULINO.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 10/09/1959 DIEZ DE SEPTIEMBRE DE MIL NOVECIENTOS CINCUENTA Y NUEVE.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : MATIAS ROMERO AVENDAÑO, JUCHITAN, OAXACA.- LA NACIONALIDAD DE LOS PROGENITORES : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por MARCO OLIVER RAMO ZAPIEN a favor del registrado .-Expediente Número 8029/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE MATIAS ROMERO AVENDAÑO, JUCHITAN, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGM');
INSERT INTO `nota` VALUES ('160', null, '2016', '8022', 'A', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a ALFREDA GUTIERREZ promoviendo por su propio derecho.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION DE EL NOMBRE DE LA REGISTRADA. OMISION DE EL ESTADO BIOLOGICO. OMISION DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. OMISION DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-OMISION DE EL NOMBRE DE LA REGISTRADA Y DE ACUERDO A LA RELACI&Oacute;N DE FILIACI&Oacute;N QUE EXISTE ENTRE LA MADRE Y LA REGISTRADA EN VIRTUD DE QUE FUE QUIEN COMPARECI&Oacute; AL MOMENTO DEL REGISTRO, LO CORRECTO DEBE SER: ALFREDA GUTIERREZ</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-OMISION DE EL ESTADO BIOLOGICO DE LA REGISTRADA Y DE ACUERDO A QUE LA INTERESADA PROMUEVE DE PROPIO DERECHO Y EN BASE A LA COPIA DE LA IDENTIFICACI&Oacute;N OFICIAL DE LA MISMA QUE SE ANEXA, LO CORRECTO DEBE SER: VIVA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-OMISION DE LA FECHA DE NACIMIENTO DE LA REGISTRADA Y DE ACUERDO A LA FECHA DE REGISTRO AL EXISTIR RELACI&Oacute;N CRONOL&Oacute;GICA ENTRE AMBAS FECHAS, LO CORRECTO DEBE SER: 02/08/1948 DOS DE AGOSTO DE MIL NOVECIENTOS CUARENTA Y OCHO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-OMISION DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA Y DE ACUERDO A EL LUGAR DE REGISTRO EN VIRTUD DE QUE JUR&Iacute;DICAMENTE EL LUGAR DE NACIMIENTO ES EL NOMBRE DE LA LOCALIDAD Y NO EL DOMICILIO , TOMANDO EN CUENTA LA CONSTANCIA DE ORIGEN Y VECINDAD QUE SE ANEXA, LO CORRECTO DEBE SER: SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: ALFREDA GUTIERREZ levantada seg&uacute;n registro n&uacute;mero 60 de fecha 16 de AGOSTO de 1948 en SANTO DOMINGO TEOJOMULCO,SOLA DE VEGA,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 141 FRACCIONES V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL NOMBRE DE LA REGISTRADA : ALFREDA GUTIERREZ.- EL ESTADO BIOLOGICO DE LA REGISTRADA: VIVA.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 02/08/1948 DOS DE AGOSTO DE MIL NOVECIENTOS CUARENTA Y OCHO.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ALFREDA GUTIERREZ por su propio derecho .-Expediente N&uacute;mero 8022/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. OFICIAL DEL REGISTRO CIVIL DE SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/LCH</p>');
INSERT INTO `nota` VALUES ('162', null, '2016', '8033', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ROSA ROJAS GARCIA promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO BUENA VISTA CACAHUATEPEC Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS DE LA ENTIDAD, LO CORRECTO DEBE SER: BUENAVISTA, SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO ROZA EN EL TEXTO DEL ACTA Y EN LA PARTE SUPERIOR DEL ACTA ROJAS ROZA Y DE ACUERDO A LA RELACION  DE FILIACION QUE EXISTE ENTRE LOS PROGENITORES Y LA REGISTRADA, LO CORRECTO DEBE SER: ROSA ROJAS GARCIA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO DIA 3 DEL ACTUAL Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 03/03/1940 TRES DE MARZO DE MIL NOVECIENTOS CUARENTA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU DOMICILIO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: BUENAVISTA, SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ROSA ROJAS GARCIA levantada según registro número 9 de fecha 15 de MARZO de 1940 en BUENAVISTA,SAN JUAN CACAHUATEPEC,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : BUENAVISTA, SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA.- EL NOMBRE DE LA REGISTRADA : ROSA ROJAS GARCIA.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 03/03/1940 TRES DE MARZO DE MIL NOVECIENTOS CUARENTA.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : BUENAVISTA, SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ROSA ROJAS GARCIA por su propio derecho .-Expediente Número 8033/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('163', null, '2016', '8015', 'C', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ANA LIDIA PEREZ SANCHEZ promoviendo a favor de ROSALIA HERNANDEZ PEREZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION PARCIAL DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL APELLIDO PATERNO DE LA REGISTRADA. ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DE LA REGISTRADA. OMISION DE EL NOMBRE DE LA ABUELA PATERNA. ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DE LA REGISTRADA. OMISION DE EL ESTADO LEGAL DE HIJO EN EL MOMENTO DEL REGISTRO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION PARCIAL DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL PUEBLO DE SANTA CATARINA QUIANE, DISTRITO DE ZIMATLAN, ESTADO DE OAXACA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SANTA CATARINA QUIANE, ZIMATLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL APELLIDO PATERNO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA PARTE SUPERIOR DEL ACTA HERNANDEZ Y EN TEXTO HERNANDES Y DE ACUERDO A LAS REGLAS ORTOGRAFICAS DE ESCRITURA, LO CORRECTO DEBE SER: HERNANDEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO DIA 20 VEINTE DEL PRESENTE MES Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 20/08/1975 VEINTE DE AGOSTO DE MIL NOVECIENTOS SETENTA Y CINCO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA NUMERO 75 DE LAS CALLES DE ALLENDE EN ESTA POBLACION Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SANTA CATARINA QUIANE, ZIMATLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO ANA LIDIA PEREZ DE HERNANDEZ Y DE ACUERDO A LOS APELLIDOS DE LOS ABUELOS MATERNOS ASENTADOS EN EL TEXTO DEL ACTA, LO CORRECTO DEBE SER: ANA LIDIA PEREZ SANCHEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-OMISION DE EL NOMBRE DE LA ABUELA PATERNA Y DE ACUERDO A SU ESCRITURA EN EL REGISTRO DE NACIMIENTO DEL PADRE DE LA REGISTRADA, LO CORRECTO DEBE SER: ROMUALDA HERNANDEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>7.-ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO PEDRO HERNANDES HERNANDES Y DE ACUERDO A EL ACTA DE NACIMIENTO DEL PADRE, LO CORRECTO DEBE SER: PEDRO HERNANDEZ HERNANDEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>8.-OMISION DE EL ESTADO LEGAL DE HIJO EN EL MOMENTO DEL REGISTRO Y DE ACUERDO A EL ESTADO CIVIL DE LOS PADRES QUE SE MENCIONA EN EL TEXTO DEL ACTA, LO CORRECTO DEBE SER: HIJA NACIDA DENTRO DE MATRIMONIO CIVIL </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ROSALIA HERNANDEZ PEREZ levantada según registro número 38 de fecha 30 de AGOSTO de 1975 en SANTA CATARINA QUIANE,ZIMATLAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I, II y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SANTA CATARINA QUIANE, ZIMATLAN, OAXACA.- EL APELLIDO PATERNO DE LA REGISTRADA : HERNANDEZ.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 20/08/1975 VEINTE DE AGOSTO DE MIL NOVECIENTOS SETENTA Y CINCO.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SANTA CATARINA QUIANE, ZIMATLAN, OAXACA.- EL NOMBRE DE LA MADRE DE LA REGISTRADA : ANA LIDIA PEREZ SANCHEZ.- EL NOMBRE DE LA ABUELA PATERNA : ROMUALDA HERNANDEZ.- EL NOMBRE DEL PADRE DE LA REGISTRADA : PEDRO HERNANDEZ HERNANDEZ.- EL ESTADO LEGAL DE HIJO EN EL MOMENTO DEL REGISTRO : HIJA NACIDA DENTRO DE MATRIMONIO CIVIL.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ANA LIDIA PEREZ SANCHEZ a favor del registrado .-Expediente Número 8015/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/BMI');
INSERT INTO `nota` VALUES ('164', null, '2016', '8035', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a EDILBERTO JACTTHAR promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION DE EL NOMBRE DEL REGISTRADO. OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE LA NACIONALIDAD DEL PADRE. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-OMISION DE EL NOMBRE DEL REGISTRADO Y DE ACUERDO A LA RELACION DE FILIACIÓN QUE EXISTE ENTRE EL PROGENITOR Y EL REGISTRADO  Y DOCUMENTOS PÚBLICOS Y PRIVADOS QUE ANEXA, LO CORRECTO DEBE SER: EDILBERTO JACTTHAR </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 25/02/1956 VEINTICINCO DE FEBRERO DE MIL NOVECIENTOS CINCUENTASEIS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA SIN NUMERO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SANTIAGO MINAS, SOLA DE VEGA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION DE LA NACIONALIDAD DEL PADRE Y DE ACUERDO A LA CONSTANCIA DE ORIGEN Y VECINDAD, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: EDILBERTO JACTTHAR levantada según registro número 9 de fecha 27 de FEBRERO de 1956 en SANTIAGO MINAS,SOLA DE VEGA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL NOMBRE DEL REGISTRADO : EDILBERTO JACTTHAR.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 25/02/1956 VEINTICINCO DE FEBRERO DE MIL NOVECIENTOS CINCUENTASEIS.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SANTIAGO MINAS, SOLA DE VEGA, OAXACA.- LA NACIONALIDAD DEL PADRE : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por EDILBERTO JACTTHAR por su propio derecho .-Expediente Número 8035/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE VILLA SOLA DE VEGA, SOLA DE VEGA, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('165', null, '2016', '8034', 'O', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a ZENAIDA MORENO MENDOZA promoviendo por su propio derecho.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. DATO ILEGIBLE DE EL SEXO. DATO ILEGIBLE DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL PUEBLO DE STA MARIA QUIEGOLANI DEL DISTRITO DE YAUTEPEC Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SANTA MARIA QUIEGOLANI, YAUTEPEC, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-DATO ILEGIBLE DE EL SEXO, TENEMOS QUE APARECE ASENTADO(A) COMO  Y DE ACUERDO A EL NOMBRE PROPIO DE LA REGISTRADA, LO CORRECTO DEBE SER: FEMENINO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-DATO ILEGIBLE DE EL ESTADO BIOLOGICO, TENEMOS QUE APARECE ASENTADO(A) COMO  Y DE ACUERDO A QUE LA MISMA REGISTRADA PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">4.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO MORENO HERNANDEZ ZENAIDA EN LA PARTE SUPERIOR Y ZENAIDA MORENO HERNANDEZ EN EL TEXTO ( ASENTANDO &nbsp;INCORRECTAMENTE EL APELLIDO HERNANDEZ , TODA VEZ QUE NO CORRESPONDE ) Y DE ACUERDO A LA RELACION  DE FILIACION QUE EXISTE ENTRE LOS PROGENITORES Y LA REGISTRADA, LO CORRECTO DEBE SER: ZENAIDA MORENO MENDOZA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">5.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 11 ONCE DEL ACTUAL Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 11/10/1970 ONCE DE OCTUBRE DE MIL NOVECIENTOS SETENTA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">6.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU DOMICILIO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SANTA MARIA QUIEGOLANI, YAUTEPEC, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: ZENAIDA MORENO MENDOZA levantada seg&uacute;n registro n&uacute;mero 48 de fecha 31 de OCTUBRE de 1970 en SANTA MARIA QUIEGOLANI,YAUTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 68 FRACCIONES III,  141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SANTA MARIA QUIEGOLANI, YAUTEPEC, OAXACA.- EL SEXO : FEMENINO.- EL ESTADO BIOLOGICO : VIVA.- EL NOMBRE DE LA REGISTRADA : ZENAIDA MORENO MENDOZA.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 11/10/1970 ONCE DE OCTUBRE DE MIL NOVECIENTOS SETENTA.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SANTA MARIA QUIEGOLANI, YAUTEPEC, OAXACA.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ZENAIDA MORENO MENDOZA por su propio derecho .-Expediente N&uacute;mero 8034/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. Oficial del Registro Civil de SANTA MARIA ECATEPEC, YAUTEPEC, OAXACA, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/LGM</p>');
INSERT INTO `nota` VALUES ('168', null, '2016', '8040', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a JUANA GUDELIA ESPINOZA CRUZ promoviendo a favor de  JUANA GUDELIA ESPINOZA CRUZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. OMISION DE LA NACIONALIDAD DE LOS PROGENITORES. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO SAN JUAN DEL ESTADO Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN JUAN DEL ESTADO, ETLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO JUANA GUDELIA EN LA PARTE SUPERIOR Y JUANA GUDELIA EN EL TEXTO Y DE ACUERDO A LA RELACION  DE FILIACION QUE EXISTE ENTRE LOS PROGENITORES Y LA REGISTRADA, LO CORRECTO DEBE SER: JUANA GUDELIA ESPINOZA CRUZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 27 VEINTISIETE Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 27/09/1962 VEINTISIETE DE SEPTIEMBRE DE MIL NOVECIENTOS SESENTADOS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA SIN NUMERO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN JUAN DEL ESTADO, ETLA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-OMISION DE LA NACIONALIDAD DE LOS PROGENITORES Y DE ACUERDO A LA CONSTANCIA DE ORIGEN Y VECINDAD, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de:  JUANA GUDELIA ESPINOZA CRUZ levantada según registro número 0 de fecha 30 de SEPTIEMBRE de 1962 en SAN JUAN DEL ESTADO,ETLA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN JUAN DEL ESTADO, ETLA, OAXACA.- EL NOMBRE DE LA REGISTRADA : JUANA GUDELIA ESPINOZA CRUZ.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 27/09/1962 VEINTISIETE DE SEPTIEMBRE DE MIL NOVECIENTOS SESENTADOS.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SAN JUAN DEL ESTADO, ETLA, OAXACA.- LA NACIONALIDAD DE LOS PROGENITORES : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por JUANA GUDELIA ESPINOZA CRUZ a favor del registrado .-Expediente Número 8040/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de VILLA DE ETLA, ETLA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGP');
INSERT INTO `nota` VALUES ('169', null, '2016', '8042', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ABEL CASTRO OLMEDO promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO. OMISION DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE LA NACIONALIDAD DE LOS PADRES. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO COMINTANCHI IXCAPA Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: CAMOTINCHAN, SAN SEBASTIAN IXCAPA, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A SE DEDUCE DE LA FECHA DE REGISTRO, TODA VEZ QUE SE REGISTRO EL MISMO DIA EN QUE NACIO Y SE DEDUCE DE LA RELACION CRONOLOGICA ENTRE LA HORA DE SU NACIMIENTO Y LA HORA EN QUE SE REGISTRO, LO CORRECTO DEBE SER: 02/07/1976 DOS DE JULIO DE MIL NOVECIENTOS SETENTA Y SEIS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION DE EL LUGAR DE NACIMIENTO DEL REGISTRADO Y DE ACUERDO A QUE EL NACIMIENTO OCURRIO EN EL MISMO LUGAR DE REGISTRO, LO CORRECTO DEBE SER: CAMOTINCHAN, SAN SEBASTIAN IXCAPA, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION DE LA NACIONALIDAD DE LOS PADRES Y DE ACUERDO A LA CONSTANCIA DE ORIGEN Y VECINDAD, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ABEL CASTRO OLMEDO levantada según registro número 30 de fecha 02 de JULIO de 1976 en CAMOTINCHAN,SAN SEBASTIAN IXCAPA,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : CAMOTINCHAN, SAN SEBASTIAN IXCAPA, JAMILTEPEC, OAXACA.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 02/07/1976 DOS DE JULIO DE MIL NOVECIENTOS SETENTA Y SEIS.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : CAMOTINCHAN, SAN SEBASTIAN IXCAPA, JAMILTEPEC, OAXACA.- LA NACIONALIDAD DE LOS PADRES : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ABEL CASTRO OLMEDO por su propio derecho .-Expediente Número 8042/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('173', null, '2016', '7983', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a SIXTA RODRIGUEZ promoviendo a favor de SIXTA  RODRIGUEZ LOPEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO SANTO DOMNGO TEOJOMULCO Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: SIXTA  RODRIGUEZ LOPEZ levantada según registro número 19 de fecha 15 de MARZO de 1939 en SANTO DOMINGO TEOJOMULCO,SOLA DE VEGA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por SIXTA RODRIGUEZ a favor del registrado .-Expediente Número 7983/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGP');
INSERT INTO `nota` VALUES ('174', null, '2016', '7981', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ALEJANDRA FERNANDEZ GOMEZ promoviendo a favor de JOSEFINA ROSAURA DEL CARMEN GOMEZ LUENGAS</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. OMISION DE EL NOMBRE DE LA REGISTRADA. OMISION DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. ERROR ORTOGRAFICO DE EL(LOS) NOMBRE(S) PROPIO(S) DE LA ABUELA PATERNA. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA ABUELA MATERNA. OMISION DE LA NACIONALIDAD DE LOS PROGENITORES. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CIUDAD DE HUAJUAPAN DE LEON Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: HEROICA CIUDAD DE HUAJUAPAN DE LEON, HUAJUAPAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE EL NOMBRE DE LA REGISTRADA Y DE ACUERDO A LA RELACION  DE FILIACION QUE EXISTE ENTRE LOS PROGENITORES Y LA REGISTRADA, LO CORRECTO DEBE SER: JOSEFINA ROSAURA DEL CARMEN GOMEZ LUENGAS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: HEROICA CIUDAD DE HUAJUAPAN DE LEON, HUAJUAPAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR ORTOGRAFICO DE EL(LOS) NOMBRE(S) PROPIO(S) DE LA ABUELA PATERNA, TENEMOS QUE APARECE ASENTADO(A) COMO TEREZA Y DE ACUERDO A LAS REGLAS DE ORTOGRAFÍA QUE RIGEN AL IDIOMA ESPAÑOL, LO CORRECTO DEBE SER: TERESA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA ABUELA MATERNA, TENEMOS QUE APARECE ASENTADO(A) COMO GONZALES Y DE ACUERDO A LAS REGLAS DE ORTOGRAFÍA QUE RIGEN AL IDIOMA ESPAÑOL, LO CORRECTO DEBE SER: GONZALEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-OMISION DE LA NACIONALIDAD DE LOS PROGENITORES Y DE ACUERDO A QUE SE DEDUCE DEL MISMO TEXTO DEL ACTA, LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: JOSEFINA ROSAURA DEL CARMEN GOMEZ LUENGAS levantada según registro número 94 de fecha 12 de MAYO de 1931 en HEROICA CIUDAD DE HUAJUAPAN DE LEON,HUAJUAPAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES I, III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 32, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : HEROICA CIUDAD DE HUAJUAPAN DE LEON, HUAJUAPAN, OAXACA.- EL NOMBRE DE LA REGISTRADA : JOSEFINA ROSAURA DEL CARMEN GOMEZ LUENGAS.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : HEROICA CIUDAD DE HUAJUAPAN DE LEON, HUAJUAPAN, OAXACA.- EL(LOS) NOMBRE(S) PROPIO(S) DE LA ABUELA PATERNA : TERESA.- EL APELLIDO PATERNO DE LA ABUELA MATERNA : GONZALEZ.- LA NACIONALIDAD DE LOS PROGENITORES : MEXICANA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ALEJANDRA FERNANDEZ GOMEZ a favor del registrado .-Expediente Número 7981/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de PRIMERA OFICIALIA DE LA HEROICA CIUDAD DE HUAJUAPAN DE LEON, HUAJUAPAN, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/CCY');
