NCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA VILLA DE NOCHIXTLAN, OAXACA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DEL LEGITIMADO, TENEMOS QUE APARECE ASENTADO(A) COMO 3 DE FEBRERO DE 1960 Y DE ACUERDO A QUE SE DEDUCE DE SU REGISTRO DE NACIMIENTO QUE SE TIENE A LA VISTA, LO CORRECTO DEBE SER: 02/02/1960 DOS DE FEBRERO DE MIL NOVECIENTOS SESENTA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de MATRIMONIO de: EULOGIO ALAVEZ HERNANDEZ levantada según registro número 136 de fecha 20 de NOVIEMBRE de 1974 en ASUNCION NOCHIXTLAN,NOCHIXTLAN,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA.- LA FECHA DE NACIMIENTO DEL LEGITIMADO : 02/02/1960 DOS DE FEBRERO DE MIL NOVECIENTOS SESENTA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ALVARO PACHECO HERNANDEZ a favor del registrado .-Expediente Número 8043/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/BMI');
INSERT INTO `nota` VALUES ('176', null, '2016', '8044', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ABEL BAUTISTA MARTINEZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A EL PADRE Y ABUELOS PATERNOS. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO CACAHUATEPEC JAMILTEPEC Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO ABEL MARTINEZ EN EL TEXTO Y EN LA PARTE SUPERIOR DEL ACTA MARTINEZ ABEL Y DE ACUERDO A QUE EL SEGUNDO APELLIDO LE CORESPONDE LEGALMENTE POR HABER SIDO LA PROGENITORA QUIEN COMPARECIO AL REGISTRO DE NACIMIENTO Y EL PRIMERO SE APLICA DE ACUERDO AL ARTÍCULO 141 FRACCIÓN VI SEGUNDA PARTE DE CÓDIGO CIVIL DEL ESTADO, LA CUAL SEÑALA QUE PROCEDE LA ACLARACIÓN DEL ACTA PARA EL SOLO EFECTO DE AGREGAR EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION, POR LO QUE EL NOMBRE COMPLETO Y CORRECTO DEBE SER:  ABEL BAUTISTA MARTINEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DIA 15 DE OCTUBRE DEL MES PROXIMO PASADO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 15/10/1966 QUINCE DE OCTUBRE DE MIL NOVECIENTOS SESENTA Y SEIS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU DOMICILIO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A EL PADRE Y ABUELOS PATERNOS POR LO QUE SE PROCEDE A TESTAR DE OFICIO.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: ABEL BAUTISTA MARTINEZ levantada según registro número 67 de fecha 03 de NOVIEMBRE de 1966 en SAN JUAN CACAHUATEPEC,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V, VI segunda parte,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA.- SE AGREGA EL PRIMER APELLIDO POR SIMPLE USO SIN CREAR FILIACION Y EL NOMBRE COMPLETO Y CORRECTO DEBE SER: ABEL BAUTISTA MARTINEZ.-LA FECHA DE NACIMIENTO DEL REGISTRADO : 15/10/1966 QUINCE DE OCTUBRE DE MIL NOVECIENTOS SESENTA Y SEIS.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA.- CON FUNDAMENTO EN EL ARTICULO 385 PARRAFO I DEL CODIGO CIVIL VIGENTE EN EL ESTADO SE AUTORIZA TESTAR DE OFICIO LOS DATOS RELATIVOS A EL PADRE Y ABUELOS PATERNOS.- Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ABEL BAUTISTA MARTINEZ por su propio derecho .-Expediente Número 8044/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('177', null, '2016', '8037', 'A', null, '<p style=\"text-align: right; line-height: 1em; font-size: 8pt\">Oaxaca de J&uacute;arez Oaxaca a 26 de MAYO de 2016</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y dem&aacute;s documentos que se acompa&ntilde;an, se tiene a EDUARDO ANTONIO promoviendo por su propio derecho.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">Instaurado el procedimiento Administrativo de aclaraci&oacute;n de cuyo expediente se cita al rubro;previsto por los art&iacute;culos 141 del C&oacute;digo Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">C  O  N  S  I  D  E  R  A  N  D  O</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- De conformidad con lo dispuesto por el Art&iacute;culo 142 del C&oacute;digo Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Direcci&oacute;n a emitir las Resoluciones Administrativas de aclaraci&oacute;n de acta.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- En la especie, el promovente solicita la aclaraci&oacute;n del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DEL REGISTRADO. OMISION DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- CON BASE EN EL AN&Aacute;LISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">1.-ERROR DE ESCRITURA DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO D&Iacute;A DE AYER Y DE ACUERDO A LA FECHA DE REGISTRO AL EXISTIR RELACI&Oacute;N CRONOL&Oacute;GICA ENTRE ESTA Y LO ESCRITO COMO FECHA DE NACIMIENTO, LO CORRECTO DEBE SER: 18/03/1948 DIECIOCHO DE MARZO DE MIL NOVECIENTOS CUARENTA Y OCHO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">2.-OMISION DE EL ESTADO BIOLOGICO DEL REGISTRADO Y DE ACUERDO A QUE EL INTERESADO PROMUEVE DE PROPIO DERECHO Y EN BASE A LA COPIA DE LA IDENTIFICACI&Oacute;N OFICIAL DEL MISMO QUE SE ANEXA, LO CORRECTO DEBE SER: VIVO</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">3.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN UNA CASA SIN NUMERO SITUADA EN LA CALLE DE HIDALGO Y DE ACUERDO A EL LUGAR DE REGISTRO EN VIRTUD DE QUE JUR&Iacute;DICAMENTE EL LUGAR DE NACIMIENTO ES EL NOMBRE DE LA LOCALIDAD Y NO EL DOMICILIO, LO CORRECTO DEBE SER: SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">CUARTO.- Esta Direcci&oacute;n es competente para conocer y resolver la petici&oacute;n planteada como en efecto.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1em; font-size: 8pt\">R  E  S  U  E  L  V  E</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">PRIMERO.- La solicitud de aclaraci&oacute;n del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">SEGUNDO.- Aclarese el acta de NACIMIENTO de: EDUARDO ANTONIO levantada seg&uacute;n registro n&uacute;mero 27 de fecha 19 de MARZO de 1948 en SANTO DOMINGO TEOJOMULCO,SOLA DE VEGA,OAXACA. a fin de que al margen de la misma se haga la anotaci&oacute;n siguiente:</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">\"...Con fundamento en lo dispuesto por los art&iacute;culos 141 FRACCIONES III, V,  y 142 del C&oacute;digo Civil Vigente en el Estado, en relaci&oacute;n a los art&iacute;culos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: LA FECHA DE NACIMIENTO DEL REGISTRADO : 18/03/1948 DIECIOCHO DE MARZO DE MIL NOVECIENTOS CUARENTA Y OCHO.- EL ESTADO BIOLOGICO DEL REGISTRADO: VIVO.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA.-  Aclaraci&oacute;n del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por EDUARDO ANTONIO por su propio derecho .-Expediente N&uacute;mero 8037/2016 .-Conste.- El jefe de la Unidad Jur&iacute;dica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">TERCERO.- Rem&iacute;tase copia de esta resoluc&oacute;n al C. OFICIAL DEL REGISTRO CIVIL DE SANTO DOMINGO TEOJOMULCO, SOLA DE VEGA, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que despu&eacute;s de haber hecho la anotaci&oacute;n correspondiente sea agregada al ap&eacute;ndice respectivo.</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">AS&Iacute; LO RESOLVI&Oacute; Y FIRMA EL C. JEFE DE LA UNIDAD JUR&Iacute;DICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">LIC. IGNACIO MANUEL MORALES MARTINEZ</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">&nbsp;</p>\r\n<p style=\"text-align: justify; line-height: 1em; font-size: 8pt\">IMM/LCH</p>');
INSERT INTO `nota` VALUES ('178', null, '2016', '8020', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a PEDRO QUERO MENDEZ Y ROSA MARTINEZ QUERO promoviendo a favor de PEDRO QUERO  MENDEZ Y ROSA  MARTINEZ QUERO</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DEL CONTRAYENTE. OMISION DE LA NACIONALIDAD DE LOS CONTRAYENTES. OMISION DE LA NACIONALIDAD DE LOS PADRES. CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE DEL  CONTRAYENTE. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE MATRIMONIO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO TLACOLULA DE MATAMOROS, OAXACA Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: TLACOLULA DE MATAMOROS, TLACOLULA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL PADRE DEL CONTRAYENTE, TENEMOS QUE APARECE ASENTADO(A) COMO PEDRO QUERO GARCIA  Y DE ACUERDO A QUE SE DESPRENDE DEL ACTA DE NACIMIENTO DEL CONTRAYENTE DE FECHA 1 DE ENERO DE 1922, LEVANTADA EN SAN PABLO VILLA DE MITLA, TLACOLULA, OAXACA , LO CORRECTO DEBE SER: PEDRO QUERO  </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION DE LA NACIONALIDAD DE LOS CONTRAYENTES Y DE ACUERDO A QUE SE DESPRENDE DEL TEXTO DEL ACTA , LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION DE LA NACIONALIDAD DE LOS PADRES Y DE ACUERDO A QUE SE DESPRENDE DEL TEXTO DEL ACTA , LO CORRECTO DEBE SER: MEXICANA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-CARECE(N) DE VALIDEZ LOS DATOS RELATIVOS A LA MADRE DEL  CONTRAYENTE POR LO QUE SE PROCEDE A TESTAR DE OFICIO.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de MATRIMONIO de: PEDRO QUERO  MENDEZ Y ROSA  MARTINEZ QUERO levantada según registro número 211 de fecha 24 de NOVIEMBRE de 1968 en TLACOLULA DE MATAMOROS,TLACOLULA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  IV del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : TLACOLULA DE MATAMOROS, TLACOLULA, OAXACA.- EL NOMBRE DEL PADRE DEL CONTRAYENTE : PEDRO QUERO .- LA NACIONALIDAD DE LOS CONTRAYENTES : MEXICANA.- LA NACIONALIDAD DE LOS PADRES : MEXICANA.- CON FUNDAMENTO EN EL ARTICULO 385 PARRAFO I DEL CODIGO CIVIL VIGENTE EN EL ESTADO SE AUTORIZA TESTAR DE OFICIO LOS DATOS RELATIVOS A LA MADRE DEL  CONTRAYENTE.- Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por PEDRO QUERO MENDEZ Y ROSA MARTINEZ QUERO a favor del registrado .-Expediente Número 8020/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE TLACOLULA DE MATAMOROS, TLACOLULA, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/ASR');
INSERT INTO `nota` VALUES ('179', null, '2016', '8038', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a FELIX MIGUEL LOPEZ LOPEZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: OMISION DE EL LUGAR DE REGISTRO. OMISION DE EL NOMBRE DEL REGISTRADO. OMISION DE LA FECHA DE NACIMIENTO DEL REGISTRADO. OMISION DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. OMISION DE EL NOMBRE DEL PADRE DEL REGISTRADO. OMISION DE EL NOMBRE DE LA MADRE DEL REGISTRADO. OMISION DE LA NACIONALIDAD DE LOS PADRES. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p