vil de fecha 26 de MAYO de 2016 .- Promovida por JOSE LUIS GARCIA VELASQUEZ a favor del registrado .-Expediente Número 8032/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SILACAYOAPAM, SILACAYOAPAM, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGP');
INSERT INTO `nota` VALUES ('183', null, '2016', '8046', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a GERMAN OLMEDO MARTINEZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. OMISION DE EL ESTADO BIOLOGICO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO BUNEVISTA CACAHUATEPEC Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: BUENAVISTA, SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE EL MISMO REGISTRADO PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO GERMAN OLMEDO EN EL TEXTO Y EN LA PARTE SUPERIOR DEL ACTA OLMEDO GERMAN Y DE ACUERDO A LA RELACION DE FILIACIÓN QUE EXISTE ENTRE LOS PROGENITORES Y EL REGISTRADO, LO CORRECTO DEBE SER: GERMÁN OLMEDO MARTINEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO DIA 2 DE MAYO Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 02/05/1954 DOS DE MAYO DE MIL NOVECIENTOS CINCUENTA Y CUATRO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU CASA HABITACION Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: BUENAVISTA, SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: GERMAN OLMEDO MARTINEZ levantada según registro número 22 de fecha 23 de MAYO de 1954 en BUENAVISTA,SAN JUAN CACAHUATEPEC,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : BUENAVISTA, SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA.- EL ESTADO BIOLOGICO : VIVO.- EL NOMBRE DEL REGISTRADO : GERMÁN OLMEDO MARTINEZ.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 02/05/1954 DOS DE MAYO DE MIL NOVECIENTOS CINCUENTA Y CUATRO.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : BUENAVISTA, SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por GERMAN OLMEDO MARTINEZ por su propio derecho .-Expediente Número 8046/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SAN JUAN CACAHUATEPEC, JAMILTEPEC, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/DCA');
INSERT INTO `nota` VALUES ('184', null, '2016', '7992', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a CRISPINA NICOLASA RUIZ DOMINGUEZ promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA. ERROR DE ESCRITURA DE EL(LOS) NOMBRE(S) PROPIO(S) DEL PADRE DE LA REGISTRADA. OMISION DE EL ESTADO BIOLOGICO. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA MADRE DE LA REGISTRADA. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL ABUELO MATERNO. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL PADRE DE LA REGISTRADA. ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL ABUELO PATERNO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL PUEBLO DE TLACAMAMA, DISTRITO DE JAMILTEPEC, ESTADO DE OAXACA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: SAN MIGUEL TLACAMAMA, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO RUIZ CRISPINA NICOLASA ( ENMENDADO) LA SEGUNDA  Y TERCER LETRA DEL SEGUNDO NOMBRE EN LA PARTE SUPERIOR Y CRISPINA NICOLASA EN EL TEXTO DEL ACTA Y DE ACUERDO A LA RELACION  DE FILIACION QUE EXISTE ENTRE LOS PROGENITORES Y LA REGISTRADA, LO CORRECTO DEBE SER: CRISPINA NICOLASA RUIZ DOMINGUEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO 5 CINCO DEL ACTUAL Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 05/12/1952 CINCO DE DICIEMBRE DE MIL NOVECIENTOS CINCUENTA Y DOS </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO EN SU DOMICILIO CASA SIN NUMERO SITUADA EN LA SECCION PRIMERA DE ESTA POBLACION Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: SAN MIGUEL TLACAMAMA, JAMILTEPEC, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>5.-ERROR DE ESCRITURA DE EL(LOS) NOMBRE(S) PROPIO(S) DEL PADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO NANUEL EN TEXTO Y MANUEL EN EL CASILLERO DEL ACTA EN ARCHIVO Y EN OFICIALIA  MANUEL  (ENMENDADO) Y DE ACUERDO A QUE SE DEDUCE DEL TEXTO DEL ACTA EN OFICIALIA, Y A LAS REGLAS DE ESCRITURA EN CUANTO AL NOMBRE PROPIO, TODA VEZ QUE LA ESCRITURA ASENTADA EN EL DOCUMENTO RESULTA INCONGRUENTE CON LA PRONUNCIACION , LO CORRECTO DEBE SER: MANUEL </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>6.-OMISION DE EL ESTADO BIOLOGICO Y DE ACUERDO A QUE LA MISMA REGISTRADA PROMUEVE POR SU PROPIO DERECHO, LO CORRECTO DEBE SER: VIVA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>7.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DE LA MADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO DOMINGUES Y DE ACUERDO A QUE ASI LO ESTABLECEN LAS REGLAS DE ORTOGRAFIA Y ESCRITURA, LO CORRECTO DEBE SER: DOMINGUEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>8.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL ABUELO MATERNO, TENEMOS QUE APARECE ASENTADO(A) COMO DOMINGUES Y DE ACUERDO A QUE ASI LO ESTABLECEN LAS REGLAS DE ORTOGRAFIA Y ESCRITURA, LO CORRECTO DEBE SER: DOMINGUEZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>9.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL PADRE DE LA REGISTRADA, TENEMOS QUE APARECE ASENTADO(A) COMO RUIS EN EL TEXTO Y RUI EN EL CASILLERO DEL ACTA EN OFICIALIA Y EN ARCHIVO RUIS Y DE ACUERDO A QUE ASI LO ESTABLECEN LAS REGLAS DE ORTOGRAFIA Y ESCRITURA, LO CORRECTO DEBE SER: RUIZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>10.-ERROR ORTOGRAFICO DE EL APELLIDO PATERNO DEL ABUELO PATERNO, TENEMOS QUE APARECE ASENTADO(A) COMO RUIS Y DE ACUERDO A QUE ASI LO ESTABLECEN LAS REGLAS DE ORTOGRAFIA Y ESCRITURA, LO CORRECTO DEBE SER: RUIZ </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: CRISPINA NICOLASA RUIZ DOMINGUEZ levantada según registro número 84 de fecha 12 de DICIEMBRE de 1952 en SAN MIGUEL TLACAMAMA,JAMILTEPEC,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 68 FRACCIONES V,  141 FRACCIONES I, III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 32, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN MIGUEL TLACAMAMA, JAMILTEPEC, OAXACA.- EL NOMBRE DE LA REGISTRADA : CRISPINA NICOLASA RUIZ DOMINGUEZ.- LA FECHA DE NACIMIENTO DE LA REGISTRADA : 05/12/1952 CINCO DE DICIEMBRE DE MIL NOVECIENTOS CINCUENTA Y DOS.- EL LUGAR DE NACIMIENTO DE LA REGISTRADA : SAN MIGUEL TLACAMAMA, JAMILTEPEC, OAXACA.- EL(LOS) NOMBRE(S) PROPIO(S) DEL PADRE DE LA REGISTRADA : MANUEL.- EL ESTADO BIOLOGICO : VIVA.- EL APELLIDO PATERNO DE LA MADRE DE LA REGISTRADA : DOMINGUEZ.- EL APELLIDO PATERNO DEL ABUELO MATERNO : DOMINGUEZ.- EL APELLIDO PATERNO DEL PADRE DE LA REGISTRADA : RUIZ.- EL APELLIDO PATERNO DEL ABUELO PATERNO : RUIZ.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por CRISPINA NICOLASA RUIZ DOMINGUEZ por su propio derecho .-Expediente Número 7992/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE SANTIAGO PINOTEPA NACIONAL, JAMILTEPEC, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/JCP');
INSERT INTO `nota` VALUES ('189', null, '2016', '8048', 'A', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a ROBERTO JESUS POLO GOMEZ promoviendo a favor de EDUARDO POLO GUTIERREZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DEL REGISTRADO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO OAXACA DE JUAREZ, OAXACA Y DE ACUERDO A LA LEY TERRITORIAL QUE FIJA LAS DENOMINACIONES Y CATEGORIAS DE LOS PUEBLOS QUE INTEGRAN LA ENTIDAD, LO CORRECTO DEBE SER: OAXACA DE JUAREZ, CENTRO, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DE LA MADRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO NORA LUISA GUTIERREZ Y DE ACUERDO A LOS APELLIDOS DE LOS ABUELOS MATERNOS DEL REGISTRADO, LO CORRECTO DEBE SER: NORA LUISA GUTIERREZ REYES </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: EDUARDO POLO GUTIERREZ levantada según registro número 10790 de fecha 19 de MAYO de 1986 en OAXACA DE JUAREZ,CENTRO,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE NACIMIENTO DEL REGISTRADO : OAXACA DE JUAREZ, CENTRO, OAXACA.- EL NOMBRE DE LA MADRE DEL REGISTRADO : NORA LUISA GUTIERREZ REYES.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por ROBERTO JESUS POLO GOMEZ a favor del registrado .-Expediente Número 8048/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. OFICIAL DEL REGISTRO CIVIL DE PRIMERA OFICIALIA DEL CENTRO, CENTRO, OAXACA Y AL C. JEFE DEL ARCHIVO CENTRAL DEL REGISTRO CIVIL, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/CRA');
INSERT INTO `nota` VALUES ('190', null, '2016', '7998', 'O', null, '<p style=\'text-align: right; line-height: 1em; font-size: 8pt\'>Oaxaca de Júarez Oaxaca a 26 de MAYO de 2016</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Visto el escrito presentado con fecha 26 de MAYO de 2016 y la(s) copia(s) del Acta que contiene el(los) error(es) que se menciona(n), y demás documentos que se acompañan, se tiene a PEDRO TORRES ROQUE promoviendo por su propio derecho.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>Instaurado el procedimiento Administrativo de aclaración de cuyo expediente se cita al rubro;previsto por los artículos 141 del Código Civil vigente en el Estado y 26, 27 y 28 del Reglamento correspondiente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>C  O  N  S  I  D  E  R  A  N  D  O</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- De conformidad con lo dispuesto por el Artículo 142 del Código Civil Vigente en el Estado, 26 y 30 del Reglamento interno del Registro civil en los que se faculta a esta Dirección a emitir las Resoluciones Administrativas de aclaración de acta.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- En la especie, el promovente solicita la aclaración del Acta antes mencionada, aduciendo que existen los siguientes errores: ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO. ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO. OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO. OMISION PARCIAL DE EL LUGAR DE NACIMIENTO DEL REGISTRADO. </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- CON BASE EN EL ANÁLISIS A LAS FOTOCOPIAS CERTIFICADAS DEL ACTA DE NACIMIENTO, SE OBSERVAN LAS SIGUIENTES INCONSISTENCIAS:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>1.-ERROR DE ESCRITURA DE EL LUGAR DE REGISTRO, TENEMOS QUE APARECE ASENTADO(A) COMO EN EL PUEBLO DE SANTIAGO AMOLTEPEC, DISTRITO DE SOLA DE VEGA Y DE ACUERDO A LA LEY QUE FIJA LAS DENOMINACIONES Y CATEGORÍAS DE LOS PUEBLOS QUE INTEGRAN LA ENITDAD, LO CORRECTO DEBE SER: SANTIAGO AMOLTEPEC, SOLA DE VEGA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>2.-ERROR DE ESCRITURA DE EL NOMBRE DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO TORRES PEDRO EN LA PARTE SUPERIOR Y PEDRO TORRES EN EL TEXTO Y DE ACUERDO A QUE EL PRIMER APELLIDO LE CORESPONDE LEGALMENTE POR HABER SIDO EL PROGENITOR QUIEN COMPARECIO AL REGISTRO DE NACIMIENTO Y EL SEGUNDO SE APLICA DE ACUERDO AL ARTÍCULO 141 FRACCIÓN VI SEGUNDA PARTE DE CÓDIGO CIVIL DEL ESTADO, LA CUAL SEÑALA QUE PROCEDE LA ACLARACIÓN DEL ACTA PARA EL SOLO EFECTO DE AGREGAR EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION, POR LO QUE EL NOMBRE COMPLETO Y CORRECTO DEBE SER:  PEDRO TORRES ROQUE </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>3.-OMISION PARCIAL DE LA FECHA DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO 28 VEINTIOCHO DEL ACTUAL Y DE ACUERDO A LA RELACION CRONOLOGICA QUE EXISTE ENTRE LA FECHA DE REGISTRO Y NACIMIENTO, LO CORRECTO DEBE SER: 28/03/1955 VEINTIOCHO DE MARZO DE MIL NOVECIENTOS CINCUENTA Y CINCO </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>4.-OMISION PARCIAL DE EL LUGAR DE NACIMIENTO DEL REGISTRADO, TENEMOS QUE APARECE ASENTADO(A) COMO EN LA CASA SIN NUMERO Y DE ACUERDO A QUE JURIDICAMENTE EL LUGAR DE NACIMIENTO ES LA LOCALIDAD Y NO EL DOMICILIO QUE SE MENCIONA, LO CORRECTO DEBE SER: RIO CIRUELO, SANTIAGO AMOLTEPEC, SOLA DE VEGA, OAXACA </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>CUARTO.- Esta Dirección es competente para conocer y resolver la petición planteada como en efecto.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: center; line-height: 1em; font-size: 8pt\'>R  E  S  U  E  L  V  E</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>PRIMERO.- La solicitud de aclaración del Acta del Estado Civil formulada por el compareciente en este expediente es procedente.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>SEGUNDO.- Aclarese el acta de NACIMIENTO de: PEDRO TORRES ROQUE levantada según registro número 41 de fecha 29 de MARZO de 1955 en SANTIAGO AMOLTEPEC,SOLA DE VEGA,OAXACA. a fin de que al margen de la misma se haga la anotación siguiente:</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>\"...Con fundamento en lo dispuesto por los artículos 141 FRACCIONES III, V, VI segunda parte,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SANTIAGO AMOLTEPEC, SOLA DE VEGA, OAXACA.- SE AGREGA EL SEGUNDO APELLIDO POR SIMPLE USO SIN CREAR FILIACION Y EL NOMBRE COMPLETO Y CORRECTO DEBE SER: PEDRO TORRES ROQUE.-LA FECHA DE NACIMIENTO DEL REGISTRADO : 28/03/1955 VEINTIOCHO DE MARZO DE MIL NOVECIENTOS CINCUENTA Y CINCO.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : RIO CIRUELO, SANTIAGO AMOLTEPEC, SOLA DE VEGA, OAXACA.-  Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por PEDRO TORRES ROQUE por su propio derecho .-Expediente Número 7998/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MORALES MARTINEZ...\"</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>TERCERO.- Remítase copia de esta resolucón al C. Oficial del Registro Civil de SANTIAGO AMOLTEPEC, SOLA DE VEGA, OAXACA, para que después de haber hecho la anotación correspondiente sea agregada al apéndice respectivo.</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'> </p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>ASÍ LO RESOLVIÓ Y FIRMA EL C. JEFE DE LA UNIDAD JURÍDICA DEL REGISTRO CIVIL EN EL ESTADO DE OAXACA. DOY FE</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>                                                                                        LIC. IGNACIO MANUEL MORALES MARTINEZ</p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'></p><p style=\'text-align: justify; line-height: 1em; font-size: 8pt\'>IMM/LGP');
