INSERT INTO `papeleta` VALUES ('207', '2016', '8003', '\"...Con fundamento en lo dispuesto por los artículos 84, 85, 141 FRACCIONES III, V, VI,  y 142 del Código Civil Vigente en el Estado, en relación a los artículos 30 ,31, 35 y 37 Fracc. I y  III del Reglamento del Registro Civil se aclaran los siguientes datos: EL LUGAR DE REGISTRO : SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA.- EL NOMBRE DEL REGISTRADO DE ACUERDO AL RECONOCIMIENTO QUE SE DETALLARA : CRISOFORO LORENZO MENDOZA REYES.- LA FECHA DE NACIMIENTO DEL REGISTRADO : 12/05/1959 DOCE DE MAYO DE MIL NOVECIENTOS CINCUENTA Y NUEVE.- EL LUGAR DE NACIMIENTO DEL REGISTRADO : SAN MATEO SINDIHUI, NOCHIXTLAN, OAXACA.- CON FUNDAMENTO EN EL ARTICULO 385 PARRAFO I DEL CODIGO CIVIL VIGENTE EN EL ESTADO SE AUTORIZA TESTAR DE OFICIO LOS DATOS RELATIVOS A LA MADRE Y LOS ABUELOS MATERNOS EN VIRTUD DE QUE UNICAMENTE EXISTE RELACION DE FILIACION ENTRE EL PADRE Y EL REGISTRADO, CON FUNDAMENTO EN EL ARTICULO 84 DEL CODIGO CIIVIL VIGENTE EN EL ESTADO DE OAXACA, SE HACE LA SIGUIENTE ANOTACION LA PERSONA A QUIEN SE REFIERE EL ACTA QUEDO RECONOCIDO(A) POR SU MADRE SEGÚN ACTA DE RECONOCIMIENTO CON NÚMERO DE REGISTRO 8 DE FECHA 27 DE ENERO DE 2000, LEVANTADA EN ASUNCION NOCHIXTLAN, NOCHIXTLAN, OAXACA. EL NOMBRE DE LA MADRE: DOMINGA REYES HERNANDEZ.-LA EDAD DE LA MADRE AL MOMENTO DEL REGISTRO: 22.-LA NACIONALIDAD DE LA MADRE: MEXICANA.- Aclaración del acta del Registro Civil de fecha 26 de MAYO de 2016 .- Promovida por RUFINO MARTINEZ CABALLERO a favor del registrado .-Expediente Número 8003/2016 .-Conste.- El jefe de la Unidad Jurídica del Registro Civil del Estado de Oaxaca.- LIC. IGNACIO MANUEL MARTINEZ MORALES...\"', 'C');
